INSERT INTO `commentaries` VALUES (11,'Memo from ekush: Looming fear of inflation','<p><strong>Macroeconomic Overview</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Despite limited exposure to the global economy, Bangladesh still might be adversely affected in the coming months due to issues like trade wars, Brexit, &amp; tension in the Middle East. Moreover, Bangladesh might face inflationary pressure from the global economy due to worldwide disruption in production &amp; supply chain. Because of Covid, Businesses also incurring freight costs as high as 1.8x than previous years. This pressure might get worse with Biden&rsquo;s $1.9 trillion stimulus package &amp; news of higher tax impose in the west.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Excess Liquidity continues to bulk up in the economy</strong></p>\r\n<p>Excess liquidity had hit BDT 2.04 trillion in January on the back of GoB&rsquo;s inadequate borrowing from the Banking sector (79.40%<strong>&nbsp;</strong>YoY decrease in 7 months) &amp; BB&rsquo;s policy of lowering repo &amp; CRR (4.75%, &amp; 4% respectively). Although it reduced to BDT 2 trillion in February with a slight increase in private sector credit growth, the economy is still facing the challenge to contain this high inflation because of swollen Broad money (14.8 trillion BDT in Feb), &amp; upcoming stimulus packages. Additionally, with Eid festivals coming, P2P inflation might reach as high as 7% in the upcoming months.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Devaluation of BDT might be coming up</strong></p>\r\n<p>A huge increase in Remittance flow (35% YoY increase) on the back of cash incentive &amp; disruption of the hundi path has contributed to the ever-growing Forex reserve of $44 billion (with $1.41 billion of ACU payments outstanding). Although this fanatic growth might not sustain in the long term since according to BMET overseas employment of Bangladeshi workers has taken a hit during the pandemic &amp; is on a declining trajectory. Exchange rate of the dollar has been stable around BDT 84.8 with BB&rsquo;s watchful intervention &amp; greenback purchase to stabilize the exchange rate &amp; a call-money rate (below 2% level). But with higher interest rates upcoming in the US to mitigate the excess liquidity &amp; inflationary pressure, Dollar might get appreciated resulting in devaluation of Taka.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Trade deficit further widens</strong></p>\r\n<p>Current account has witnessed a positive Balance of $4.32 billion on the back of remittance &amp; higher inflow of medium &amp; long-term loans, grants despite the declining trend in FDI &amp; widening trade deficit ($6.5 billion). This Trade deficit has widened amid a rising import payment pressure (MoM 24.15% growth in Jan) mostly from the pent-up raw material &amp; Capex demand of the readymade garments sector. However, export did not increase comparatively (MoM 3.83% growth in Jan) due to sluggish international demand.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Deteriorating NPL situation</strong></p>\r\n<p>There&rsquo;s also a big exposure building up in the economy with its banking sector, which was already tattered with NPL situation. It might deteriorate further with the presence of adverse selection &amp; moral hazard while disbursing stimulus package &amp; extending the moratorium period to June (December 2022 in case of demand loans). This will suddenly reveal a massive void in the economy during the post-Covid phase. There&rsquo;s been a preference among the banks to lend large borrowers instead of SMEs, thus walking towards a K-shaped recovery. However, there&rsquo;s a chance of interest rate going up next year with the lifting of single-digit rate to sweep off this liquidity glut from the economy.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Adverse Impact of Lockdown</strong></p>\r\n<p>With the second wave of pandemic already creeping our shores, the recovery seems further away. The question remains when things will go normal. Meanwhile, due to the lockdown, economic activities will continue to face uncertainty in achieving GoB desired V-shaped recovery. GoB has already revised the GDP growth target to 7.4% from 8.2% while actual growth might be lower than that. There is still hope for excess liquidity to be mitigated with the economy picking up &amp; private sector credit growth increase. GoB has already set a target of 14.8% growth in the Private sector Credit with its pent-up Capex demand. Like the US, wider budget deficit &amp; rising external debt obligation to be met by a wide array of tax imposition on consumer goods which in turn will be borne by general people again resulting in inflationary pressure.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Capital Market Overview</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Underperforming Q1</strong></p>\r\n<p>Capital Market started the year with a big jump by reaching 5,600 points after 21 months. The quarter started with a DSE index of 5618.96 points &amp; ended with 5,278.16, thus occurring a quarterly decrease of 6%. Beginning ADTV for the quarter was BDT 19.28 billion &amp; ended with BDT 5.6 billion. Major market movers have seen a somewhat decrease during the period; GP (8.3%&nbsp;<strong>&darr;</strong>),&nbsp;SQURPHARMA (17.3%&nbsp;<strong>&darr;)</strong>, BRACBANK (11.9%&nbsp;<strong>&darr;)</strong>, SUMITPOWER (4.1%&nbsp;<strong>&uarr;</strong>), ROBI (35.5%&nbsp;<strong>&uarr;)</strong>, WALTONHIL (1.2%&nbsp;<strong>&uarr;)</strong>, BATBC (27%&nbsp;<strong>&uarr;)</strong>, OLYMPIC (14.9%&nbsp;<strong>&darr;)</strong>, BXPARMA (11.5%&nbsp;<strong>&darr;)</strong>, BEXIMCO (17.7%&nbsp;<strong>&uarr;)</strong>, RENATA (2.9%&nbsp;<strong>&uarr;</strong>), UPGDCL (3.5%&nbsp;<strong>&darr;)</strong>, BERGERPBL (20.4%&nbsp;<strong>&uarr;)</strong>, MARICO (4.3%&nbsp;<strong>&darr;).</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Over purchase of NSC continues</strong></p>\r\n<p>It seemed like the market had recovered &amp; was on its way to 6000 points. Single-digit interest rate, negative real return from bank deposit, excess liquidity, GoB&rsquo;s quick measure to avail vaccines, all created a positive outlook in investors&rsquo; minds. But news of 2<sup>nd</sup>&nbsp;wave upcoming &amp; investors&rsquo; uncertainty about the market resulted in tunneling of excess funds towards NSC (58% increase in purchase YoY) &amp; Real-Estate. Moreover, foreign investors&rsquo; (constitutes 15.90% of the free float) continuous selling in the market amid the volatility has resulted in another source of a hiccup for the market.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Disappointing IPO return</strong></p>\r\n<p>On the positive side, BDT 200 crore from special fund formed by each bank yet to fully enter the market, which might provide good support in the upcoming days. A few IPOs entered the market during the quarter; Taufika Foods &amp; Agro Industries Limited, Desh General Insurance, NRBC Bank Limited &amp; Index Agro Industries Limited have already come to the secondary market. Additionally, a new bidding method has been introduced to the Eligible Investors (EI) by the BSEC to set the maximum cut-off price for an IPO share to eliminate overbidding by the EIs.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Lifting Floor Price for 66 listed companies</strong></p>\r\n<p>At the end of the quarter, BSEC also decided to lift the floor price for 66 companies as those companies&rsquo; trading was ongoing at the floor price for a long time. That impacted negatively in the bourse. Some level of stir up will still happen due to this lockdown but fundamentally good companies are expected to absorb this shock &amp; show signs of profitability &amp; good return in the long run.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Performance of Ekush First Unit Fund (EFUF)</strong></p>\r\n<p>In our relentless effort to serve our investors, we focus on the companies that are fundamentally good &amp; worth holding for the long term. Several shares have done significantly well for the last two decades, like BATBC, OLYMPIC, MARICO, BERGERPBL, RENATA,&nbsp;SQURPHARMA, RECKITTBEN, etc.</p>\r\n<p>&nbsp;</p>\r\n<p>Even during such tough times, in our endeavor to provide the best possible risk-adjusted return, we put greater consideration on the companies with good governance, efficient management &amp; competitive edge in their relevant industries. With this particular notion in mind, we have allocated 63% of our portfolio towards the equity market keeping the fundamentally good stocks with outperforming capacity in the long term.</p>\r\n<p>&nbsp;</p>\r\n<p>10% of our allocation was also behind 2 IPO shares. This quarter&rsquo;s biggest IPO offering was Baraka Patenga Power Limited &amp; we have been able to secure our bid in it with an amount of BDT. 22,496,000 with a cut-off price of BDT 32.00. Another one was Index Agro Industries Limited which was yet to come at that time.</p>\r\n<p>&nbsp;</p>\r\n<p>With our view to further tap into the superior IPO return, we have also invested in other funds, preferably with good fund managers &amp; small in size, allocating 9% of the portfolio.</p>\r\n<p>&nbsp;</p>\r\n<p>And lastly, to better balance the risk for our investors, we have also invested BDT 1.5 Crore in FDR with Delta BRAC Housing, one of the best NBFI of the country with an AAA credit rating, which comprises 6% of the portfolio investment. We had held cash &amp; cash equivalent which was 12% of the portfolio at the time in the intuition of future market fall to purchase shares at favorable prices.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>We are always observing the market situation &amp; looking for attractive opportunities in this current period of uncertainty. We strongly believe that such time provides a good buy opportunity to hold fundamentally good shares at a favorable price, which will provide maximum return for the fund in the long run.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Thank you for choosing Ekush &amp; keeping your faith in us. Stay Safe &amp; blessed. Thank you.</strong></p>','2021-04-01 00:00:00',NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-20 08:43:48','2021-04-20 08:43:48',NULL),(12,'Memo from Ekush: People in severe distress due to inflation','<p style=\"font-weight: 400;\"><strong>MACROECONOMIC OVERVIEW</strong></p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\"><br />Retaining the focus on the 8th five-year plan, the budget for the fiscal year 2021-22 has been proposed when we are experiencing an aggravated Covid-19&nbsp;<u>second wave</u>. Both the death toll &amp; positivity rate hit a new peak in the second quarter.</p>\r\n<p style=\"font-weight: 400;\"><br />Due to the rising oil price in the international market &amp; swelled up money supply, the economy is undergoing an inevitable&nbsp;<u>inflationary pressure</u>. Decreasing affordability of general people is more evident than ever with the soaring price of everyday transportation, food &amp; essential products. Along with&nbsp;<u>massive unemployment</u>, this unaffordability pushed 30% of the people under the poverty line from 21% in 2019.</p>\r\n<p style=\"font-weight: 400;\">&nbsp;<strong><br /></strong></p>\r\n<p><strong>Expansionary fiscal policy to counter the pandemic situation</strong></p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">Keeping the focus on VISION 41 to make Bangladesh a developed country by 2041, the government facilitated local enterprises with&nbsp;<u>reduced tax&nbsp;</u>(2.5% across listed &amp; non listed except, financial institutions, telco, &amp; tobacco) to create more jobs &amp; raise economic activities.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">The budget size is BDT 6 Lakh Crore (12% up from last year), which is 17.5% of the GDP.&nbsp;Moreover, the budget deficit of BDT 2 lakh crore is to be financed by&nbsp;<u>Bank Borrowing</u>&nbsp;(35.6%), Non-Bank Borrowing (17.2%) &amp; External Sources (47.2%).&nbsp; The GDP growth rate for 2020-21 is revised at 6.1% while the target growth rate for the upcoming fiscal year is set at 7.2%.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">The top 3 sectors to get the&nbsp;<u>most allocation</u>&nbsp;of the expenditure are Human resources (26%), General Service (24%) &amp; Agriculture (12%). ADP Expenditure is set at BDT 2.25 Lakh Crore (9.8% up from last year), which is 37.5% of the budget. Health, Education &amp; Technology, Transport and Communication, Fuel and Energy, and Agriculture are some of the divisions with the highest allocation of ADP funds of the budget.<br /><br /></p>\r\n<p><strong>Liquidity&nbsp;<u>g</u>lut results in further interest spread &amp; inflationary pressure for the economy</strong></p>\r\n<p style=\"font-weight: 400;\">The weighted average interest spread continues to increase with the burgeoning money supply. It is lowering the deposit rate with a comparatively flat lending rate: (3.26% in May vs 3.04% in April). Excess liquidity in the economy stood at BDT 2.02 lakh crore and continuing to flood in.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">Apparently,<u>&nbsp;private sector credit</u>&nbsp;demand is low due to the second wave of the pandemic. Moreover, with the incoming stream of remittance, this excess liquidity has driven the inflationary pressure (from 5.26% to 5.64%) to be more perennial than ever.&nbsp;P2P food inflation (from 4.87% to 5.45%) &amp; non-food inflation (from 5.86%-5.94%) both have risen alarmingly from May to June.<br /><br /></p>\r\n<p><strong>Overreliance on consumer tax widens&nbsp;</strong><strong>the&nbsp;</strong><strong>real income gap</strong></p>\r\n<p style=\"font-weight: 400;\">Reluctance to submit tax on personal income &amp; overreliance on consumption-based taxes (VAT, SD &amp; Tariffs) have resulted in a higher Gini-coefficient; a measure of income inequality for the country. From 0.46 in 2010 to going 0.48 in 2016, it is now 0.52 (where 0.4-0.5 indicates big income gap &amp; &gt;0.5 indicates severe income gap).&nbsp;This shows despite the increasing per capita income (USD 2,227), the&nbsp;<u>gap between rich &amp; poor&nbsp;</u>is wider than before.<br /><br /></p>\r\n<p><strong>Expansionary monetary&nbsp;policy with the focus of reviving the economy</strong></p>\r\n<p style=\"font-weight: 400;\">Expansionary monetary policy of Bangladesh Bank, continuous declining deposit rate, government&rsquo;s stimulus package &amp; greater remittance inflow have resulted in the&nbsp;<u>highest ever money supply&nbsp;</u>in the economy BDT 15.3 Lakh Crore (12.9% YoY increase).&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">BB is focused on continuing this expansionary policy to keep facilitating the pandemic-hit economy, especially since the YoY private sector credit growth is on a declining trend (7.6% in May vs 8.3% in April). The private sector&rsquo;s&nbsp;<u>reluctance to borrow&nbsp;</u>has been one of the biggest challenges for the GoB&rsquo;s endeavor to revive the economy, hence the growth is 7.2% lower than the government&rsquo;s second half-yearly target of 14.8%.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">But this expansionary policy is<u>&nbsp;fuelling the NPL</u>&nbsp;situation in the economy. Despite extending the moratorium period, the volume of NPL grew by 9% to BDT 95,085 Crore (Jan-Mar) which is 8.07% of the total outstanding loan.<br /><br /></p>\r\n<p><strong>Forex reserve continues to increase backed by&nbsp;</strong><strong>the&nbsp;</strong><strong>staggering spurt in remittance</strong></p>\r\n<p style=\"font-weight: 400;\">Despite deepening trade deficit (increase 23.5% YoY), the country&rsquo;s current account deficit has been reduced by 58% YoY (July- May) from negative 4.4 Billion USD to negative 1.8 billion USD. With every other account being somewhat consistent with the previous year, the major difference was due to the<u>&nbsp;surge in private transfers</u>, precisely foreign remittance.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">With&nbsp;<u>2% cash incentive</u>, ease in money transfer facility &amp; disruption of hundi channel, the remittance flow has increased by 36% YoY &amp; resulted in an all-time high Forex reserve of USD 46.4 billion as of June 2021. Government plans to continue this 2% cash incentive in the next fiscal year as well.<br />&emsp;</p>\r\n<p><strong>Commendable performance in export over the last year</strong></p>\r\n<p style=\"font-weight: 400;\">With lockdown being lifted in the west, our export has increased by 15.1% YoY &amp; 1.2% QoQ, with the RMG sector&rsquo;s growth of 12.6% YoY. This increase is backed by the government&rsquo;s<u>&nbsp;supportive activities</u>&nbsp;such as: increasing the EDF Fund (Export Development Fund) from BDT 350 Crore to BDT 550 Crore, 1% incentive to textile &amp; garment&rsquo;s sector &amp; allocation of BDT 5,000 crore loan fund for the payment of workers &amp; employees in the export-oriented industries. Government plans to continue this 1% incentive into the next fiscal year as well. Meanwhile, import has also increased by 17.28% YoY by the end of May 2021.<br /><br /></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>CAPITAL MARKET OVERVIEW</strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p><strong>Market hits the 6000 ballpark index value</strong></p>\r\n<p style=\"font-weight: 400;\">In this quarter, the capital market<u>&nbsp;revived quite nicely</u>. The quarter started with a DSEX index of 5,270.5 points &amp; ended with a staggering 6,150.5 points (up 16.7%). Daily ADTV (Average Daily Trade Volume) was BDT 451 Crore at the beginning against BDT 1,408 Crore at the end of the quarter.<br /><br /></p>\r\n<p><strong>Well performing IPOs</strong></p>\r\n<p style=\"font-weight: 400;\">One of the most hyped IPO NRBC Bank, which came at the end of March, showed an overwhelming upside of 3 times by the end of the quarter (BDT 32.10). Desh General Insurance (DGIC) ended the quarter at BDT 48.2 (up by 482%). SONALILIFE came to the market at the end of this quarter attaining a staggering 7 times return by July. Meanwhile,&nbsp;<u>South Bangla Agriculture &amp; Commerce (SBAC) Bank&nbsp;</u>has also come to the market through the fixed-price method to raise BDT 100 Crore.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">Nialco Alloys (NIALCO) is the 1st ever IPO to come to the SME board this quarter, which is the start of something optimistic for the capital market. NIALCO is currently priced at 21.20 (up by 212%).&nbsp;<u>Four more IPOs</u>: Mostafa Metal Industries Limited&nbsp;<strong>(BDT 11 Crore)</strong>, Oryza Agro Industries Limited&nbsp;<strong>(BDT 10 Crore)</strong>, Subra Systems Limited&nbsp;<strong>(BDT 12 Crore)</strong>, and Master Feed Agrotec Limited&nbsp;<strong>(BDT 10 Crore)</strong>&nbsp;are also coming to the market in the near future.<br /><br /></p>\r\n<p><strong>Capital market outlook</strong></p>\r\n<p style=\"font-weight: 400;\">With this all-time high money supply &amp; the inflationary pressure that comes with it, people are more eager than ever to invest to prevent the devaluation of their money. In this regard, the National Savings Certificate (NSC) &amp; Real Estate are the most preferable choice apart from the capital market.<br /><br /><u>Fresh money&nbsp;</u>is coming to the market &amp; currently, the market resides at 6,400 points. This growth was&nbsp;mainly&nbsp;fueled by the insertion of black money to the capital market. With more fresh money coming, the market&rsquo;s next resistance at 6,700 points is highly likely to be achieved&nbsp;with good support at the 5,900 level. But the sustainability of higher market&nbsp;level&nbsp;remains questionable as&nbsp;<u>major macroeconomic risks</u>&nbsp;are hidden in the&nbsp;economy particularly&nbsp;bad NPL, high unemployment, and the aftermath of the pandemic.</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">Despite the reduction in economic calls, soaring data usage among subscribers ensures future telecommunication industry upside. With the increase in overall market size, the Pharmaceutical industry is to withstand a steady growth.<br /><br /></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>OUR INVESTMENT STRATEGY: LONG TERM AND WELL-DIVERSIFIED</strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-weight: 400;\"><br />Our managed fund provided a&nbsp;<u>49.10% return</u>&nbsp;since its inception, 18 march, 2020 including an 8% cash dividend disbursed for the year 2020.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">In our continuous effort to provide the best wealth management service, we choose stocks with good fundamentals &amp; proper corporate governance.&nbsp; Our allocation is&nbsp;<u>highest in equity (80%)</u>&nbsp;representing our bullish view on the equity market in long term.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">Here are our top 5 stocks:<br /><br /></p>\r\n<p style=\"font-weight: 400;\"><u>Sl</u>&nbsp;<u>Company</u>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;<u>Weight</u><br /><br />01&nbsp;GP&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;11%<br /><br />02&nbsp;BATBC&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;11%<br /><br />03&nbsp;BRACBANK&nbsp;&nbsp;&nbsp;10%<br /><br />04&nbsp;MARICO&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10%<br /><br />05&nbsp;RENATA&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;8%</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\">&nbsp;</p>\r\n<p style=\"font-weight: 400;\"><img src=\"/storage/files/source/image.png\" alt=\"\" width=\"323\" height=\"222\" /></p>\r\n<p style=\"font-weight: 400;\"><br /><br />The portfolio is&nbsp;<u>well-diversified</u>&nbsp;among 13 stocks and 9 sectors which we view will do well in the future.<br /><br /></p>\r\n<p style=\"font-weight: 400;\">We are always observing the market situation &amp; looking for attractive opportunities to buy fundamentally good stocks at a favorable price, to provide a maximum return in the long run.<br />Please visit our website to know more details:&nbsp;<a href=\"/\" data-saferedirecturl=\"https://www.google.com/url?q=https://ekushwml.com/&amp;source=gmail&amp;ust=1627539537737000&amp;usg=AFQjCNHchSq3saAOnmS4oLUTA1OyVfbdUg\">https://ekushwml.com/</a>&nbsp;and email us if you have any queries at&nbsp;<a href=\"mailto:info@ekushwml.com\">info@ekushwml.com</a>.<br /><br /></p>\r\n<p><strong>Stay Safe &amp; Thank you.</strong></p>','2021-07-01 00:00:00',NULL,1,0,1,1,NULL,NULL,NULL,'2021-07-28 06:23:12','2021-07-28 06:23:43',NULL);
