INSERT INTO `contents` VALUES (1,'Your wealth will flourish better with Ekush','your-wealth-will-flourish-better-with-ekush','','“Ekush Wealth Management Limited believes that success in wealth mangement beneath the creation of sustainable long-term wealth for its investors. At Ekush, we believe that achieving our clients’ financial freedom defines our true success. With Ekush Wealth Management, you can be assured of having unparalleled investment solutions to achieve your financial success.”',NULL,NULL,'',1,1,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(2,'Mutual Fund','mutual-fund','','Mutual Fund is a diversified pooled investment vehicle that provides investment solutions not only to people of all walk of life but also to large corporate. \"Ekush First Unit Fund\" is our first mutual fund.',NULL,NULL,'',1,2,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(3,'Institutional Fund Management','institutional-fund-management','','Under the umbrella of \"Separately Managed Accounts (SMA)\", we provide customized investment solutions for Institutions based on client specific risk-return objctives, constraints, rules and regulations.',NULL,NULL,'',1,2,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(4,'Structured Finance','structured-finance','','Ekush helps corporates not only to craft their optimum financing strategies but also to implement the stratigies by arranging debt and equity finance both from local and international financers.',NULL,NULL,'',1,2,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(12,'Company Overview','company-overview','','<p>Ekush Wealth Management Limited (Ekush) is an “Asset Management Company” registered with Bangladesh Securities and Exchange Commission (BSEC) since September 5, 2019. Embracing our ‘investor first’ approach, Ekush is committed to deliver the best possible solutions in the field of wealth management, corporate advisory and structured finance.</p><p>At Ekush, we strive to be emerged as “asset managers, not asset gatherers” by improving the investment ecosystem for you wherein we can create long-term wealth by prudently investing your money through our mutual funds.</p>',NULL,NULL,'',2,3,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(13,'Vision','vision','','Wealth Management for Greater Good.',NULL,NULL,'',2,4,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(14,'Mission','mission','','To develop and uphold an Eco-system for ensuring greater good and shaping a colorful future.',NULL,NULL,'',2,4,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(15,'Ethical Standards','ethical-standards','','We will place, practice, upgrade and uphold the highest level of ethical standards in wealth management services.',NULL,NULL,'',2,4,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(16,'Objectives','objectives','','<ul>\n	<li>To provide sustainable risk-adjusted return to the investors</li>\n	<li>To facilitate worthy investment opportunities through structured financial solutions</li>\n	<li>To create a high-tech and an efficient operation</li>\n	<li>To ensure quality growth of the asset under management</li>\n	<li>To conduct buy-side investment research activities for above market investment performance</li>\n	<li>To create an &ldquo;equity&rdquo; oriented open culture</li>\n</ul>',NULL,NULL,'',2,4,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(17,'Idea Meritocracy','idea-meritocracy','','',NULL,NULL,'',2,5,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(18,'Meaningful Relationship','meaningful-relationship','','',NULL,NULL,'',2,5,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(19,'Radical Truth and Integrity','radical-truth-and-integrity','','',NULL,NULL,'',2,5,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(20,'Ekush','ekush','','Ekush requires people to be extremely open, air disagreements, test each other’s logic, and view discovering mistakes and weaknesses as a good thing that is expected to lead to improvement and innovation<br><br>By continually striving together for the highest levels of integrity and excellence, we can create meaningful work and meaningful relationships.',NULL,NULL,'',2,5,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(21,'Mr. Md. Waliullah, FCA','mr-md-waliullah-fca','Chairman','Mr. Waliullah is the Chairman of Ekush Wealth Management Limited. He is also the Managing Partner of Malek Siddiqui Wali & Co. Chartered Accountants. Mr. Waliullah, a veteran entrepreneur, assisted in establishing Satcom IT Ltd, Satcom Agro Limited, Alpha Credit Rating Limited, Authorized Distribution-ship of “Apple Inc.” in Bangladesh and Ekush Wealth Management Limited during his passionate and dedicated journey since 1980’s. His vision is to empower people and to enrich marginal peoples’ living through quality financial and associated services. Mr. Waliullah, a FCA from ICAB, is an avid reader and inspirer for the next generations.',NULL,NULL,'',2,6,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(22,'Mr. Swadesh Ranjan Saha, FCA, FCS','mr-swadesh-ranjan-saha-fca-fcs','Vice-Chairman','Mr. Swadesh is the Vice-chairman of Ekush Wealth Management Limited, Satcom IT Limited and Satcom iCenter Ltd. He is the Senior Partner of Malek Siddiqui Wali & Co. Chartered Accountants , Managing Director of Satcom Computers Limited, Director of Satcom Agro Processing Ltd & Alpha Credit Rating Ltd. He is the current President of Dhaka University Accounting Alumni Association and on of the founder & governing body members of Dhaka Imperial College. He is fellow member of Institutue of Chartered Accountant Bangladesh (ICAB), Institute of Chartered Secretaries of Bangladesh (ICSB) and Institute of Association of Accounting Technician of Bangladesh (AATB). He was the District Governor of Dist. 312 A2, Council Chairman of MD 315, Bangladesh . He was also the GMT Area Leader of MD315 and MD 322 in the year 2017-2019 of Lions Club International. He actively participates in various philanthropic activities.',NULL,NULL,'',2,6,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(24,'Mrs. Rahnuma Sanjana','mrs-rahnuma-sanjana','Director','Mrs. Rahnuma is one of the Directors’ of Ekush Wealth Management Limited. She is also Lecturer of Business & Economics Faculty of North South University (NSU) of Bangladesh. Mrs. Sanjana is dedicated to communicate global finance practices to the next generations through her professional engagement both directly and indirectly. She has completed her Master of Arts (M.A) in Economics from San Francisco State University (USA) and B.B.A from IBA, University of Dhaka. She has also completed level I of CFA Program.',NULL,NULL,'',2,6,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(25,'Mr. Kazi Ahsan Maruf, CFA','mr-kazi-ahsan-maruf-cfa','Managing Director','<p>Mr. Maruf has extensive experience in investment management industry with a career spanning over 15 years. Before assuming his current role, he was the Chief Executive Officer of IL Capital Limited.&nbsp; He started his career in capital market as Investment Analyst and subsequently promoted to Risk and Portfolio Manager. He voluntarily worked as a seasonal course instructor of an educational institution on investment. His vision is to provide value to the investors&rsquo; life so that they can reach their financial goals in the long term. He is a CFA charter holder and a member of the CFA Society, Bangladesh. He has completed BBA from Finance Department of Faculty of Business Studies, University of Dhaka.</p>',NULL,'2023-03-22','',2,6,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2023-03-22 03:16:18',NULL),(27,'Mr. Shuva Saha, CFA','mr-shuva-saha-cfa','Director & Chief Strategy Officer','Mr. Shuva, Director of Ekush, is working as the Chief Strategy Officer for the Company. As an investment professional, he has a diverse work experience of more than 10 years with Bank, NBFI, Merchant Bank and Brokerage under the scope of portfolio management, equity research, underwriting and issue management, fund raising etc. Prior to joining Ekush, he was with Modhumoti Bank Limited as FAVP and played a pivotal role as a member of the Investment Committee of the Bank. Mr. Shuva also worked with Union Capital Limited and its capital market intermediaries, Abaci Investments Limited and Multi Securities & Services Limited. Mr. Shuva is a CFA Charterholder since 2017 and has completed his BBA and MBA from University of Dhaka with Major in Finance.',NULL,NULL,'',2,6,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(28,'Advisor','advisor','','A financial consultant who offers professional advice on investment in Mutual funds and supervises management of the assets.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(29,'Annualized Return','annualized-return','','Annualized return is the hypothetical annual rate of return calculated over a longer or shorter period of time and annualized for comparison with a 1-year return. It is expressed as a percentage and is calculated under the assumption that all dividends and capital gains are re-invested',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(30,'Arbitrage','arbitrage','','An equity share trading on more than one stock exchanges might have minute price difference. Arbitrage is the practice of buying the stock on one exchange and selling on another one in order to book profits.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(31,'Asset','asset','','Property and resources, such as cash and investments, comprise a person\'s assets; i.e., anything that has value and can be traded. Examples include stocks, bonds, real estate, bank accounts, and jewellery.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(32,'Amortization','amortization','','A method of equated monthly payments over the tenure of a loan. Repayment of a loan is usually done in monthly installments; however, other repayment frequencies might also be offered by some lenders (quarterly/ annually / any other frequency). During the early part of any loan, repayment of the interest is higher than that of the principal. This relationship is reversed enduring the later stages of the loan.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(33,'Appreciation','appreciation','','When an investment increases in value, it appreciates. For example, an equity share whose price goes from Rs. 20/- to Rs. 25/- has appreciated by Rs. 5/-.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(34,'',NULL,'','The asked or offering price means the current net asset value (NAV) per share plus sales charge, if any. For a no-load fund, the asked price is the same as the NAV.',NULL,NULL,'',4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(37,'Let your Money Work Harder','let-your-money-work-harder','','',NULL,NULL,'',6,10,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(38,'Learn Mutual Fund','learn-mutual-fund','','',NULL,NULL,'',6,10,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(39,'Fund Arrangement','fund-arrangement','','<p>The experienced team of Ekush communicates, interacts and collaborates at the right time and in the right measure throughout the fund arrangement process:</p>\n                <li>Arrange private equity fund from investors (local & foreign)</li>\n                <li>Act as a Match Maker between potential buyers & sellers in equity transaction</li>\n                <li>Arrange low cost foreign currency loan</li>\n                <li>Sourcing fund through alternative issues like preference share, zero-coupon bond etc.</li>',NULL,NULL,'',8,12,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(40,'Corporate Advisory','corporate-advisory','','<p>Ekush Advisory Services provide corporate owners and managers tailor-made solutions to make more informed decisions to meet their strategic corporate objectives:</p>\n                <li>Developing corporate finance strategies</li>\n                <li>Company valuation</li>\n                <li>IPO advisory services</li>\n                <li>Project feasibility & business planning</li>',NULL,NULL,'',8,13,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(41,'Institutional Fund Management','institutional-fund-management-1','','<p>Thrust of our investment professionals is to deliver superior fund management solution to the community by leveraging years of experience and skills</p>\n\n<ul>\n	<li>\n	<p>We serve our investors conventional and customized investment products suitable for client&rsquo;s specific needs and circumstances. We listen our clients carefully to understand their investment and financial requirements.</p>\n	</li>\n	<li>\n	<p>EKUSH offers Portfolio Management Services (PMS) to a group of institutional investors with common investment goals through a discretionary investment account. These products will give our clients opportunity to take exposure in potential securities based on fundamental and quantitative analysis.</p>\n	</li>\n	<li>\n	<p>We also serve Separately Managed Account (SMA) for a particular institutions which offer more control over investments, increased transparency when it comes to individual trades in the portfolio, and, perhaps more importantly, customization. Individual risk-return appetite, flexible fee structure with performance fee can be addressed precisely.</p>\n	</li>\n	<li>\n	<p>Under this umbrella, our aim is also to manage funds voluntarily for those institutions which are working for the good cause to our society.</p>\n	</li>\n</ul>\n                    </p>',NULL,NULL,'',7,11,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-18 00:58:08','2021-04-18 00:58:08',NULL),(42,'Basa','basa',NULL,'<p>An equity share trading on more than one stock exchanges might have minute price difference. Arbitrage is the practice of buying the stock on one exchange and selling on another one in order to book profits.</p>',NULL,'2021-04-26',NULL,4,8,NULL,1,0,1,1,NULL,NULL,NULL,'2021-04-27 08:21:08','2021-04-27 08:21:08',NULL),(43,'How to save 82% of your tax expenses in 2021?','how-to-save-82-of-your-tax-expenses-in-2021',NULL,'<p>you can save tax by investing in Bank DPS, Shanchaypatra or Unit Fund? find out which one is better for you.<iframe src=\"//www.youtube.com/embed/HflMHdMq3fQ\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',NULL,'2021-06-13','HflMHdMq3fQ',5,9,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-13 11:46:23','2021-07-26 14:51:42',NULL),(44,'What compounding?','what-compounding',NULL,'<p>Compounding is the 8th wonder of science? Find it out</p>\r\n<p><iframe src=\"//www.youtube.com/embed/2LZke01wuWw\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',NULL,'2021-06-13','2LZke01wuWw',5,9,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-13 11:56:41','2021-07-26 14:47:40',NULL),(55,'KAMRUL HASAN MAHMUD, Assistant Manager, Planning Department, SM Knitwear Limited','kamrul-hasan-mahmud-assistant-manager-planning-department-sm-knitwear-limited',NULL,'<p>I thank Ekush for embedding the habit of saving in me. I took their SIP to save monthly for my future. It&rsquo;s totally hassle free way to invest.&nbsp;</p>',NULL,'2021-08-22',NULL,3,7,NULL,1,0,1,1,NULL,NULL,NULL,'2021-08-25 04:40:29','2021-08-25 04:40:29',NULL),(56,'MOHAMMAD AKIB NAWAZ, Associate, Business Development, Dotlines Group (Owner of Ghoori Learning)','mohammad-akib-nawaz-associate-business-development-dotlines-group-owner-of-ghoori-learning',NULL,'<p>I invested in Ekush managed funds to avail Tax Rebate. Not only did I save my income from taxes but also earned higher return than bank deposits.</p>',NULL,'2021-08-25',NULL,3,7,NULL,1,0,1,1,NULL,NULL,NULL,'2021-08-25 05:23:41','2021-08-25 05:23:41',NULL),(59,'Meherun Nessa Juthy, Head of Support & Maintenance, Dcastalia Limited','meherun-nessa-juthy-head-of-support-maintenance-dcastalia-limited',NULL,'<p>Ekush Wealth Management Limited is always responsive to any questions I have, they keep me informed every month\'s details of my investment. And I am well-pleased with their services.</p>',NULL,'2022-05-18',NULL,3,7,NULL,1,0,1,1,NULL,NULL,NULL,'2022-05-18 10:12:39','2022-05-18 10:12:39',NULL),(60,'Saeed Akram Shanto, Owner of \"Sarder Trading\"','saeed-akram-shanto-owner-of-sarder-trading',NULL,'<p><em>Ekush Wealth Management Limited Investment\'s approach of identifying our future needs/goals and then working out how to achieve them is a vital approach to reduce the lottery of financial planning.</em></p>',NULL,'2022-05-19',NULL,3,7,NULL,1,0,1,1,NULL,NULL,NULL,'2022-05-19 05:06:59','2022-05-19 05:06:59',NULL),(63,'Tamrin Al-Deen','tamrin-al-deen','Chief Investment Analyst','<p>Mr. Tamrin Al-Deen, an equity research enthusiast, has joined Ekush as the Chief Investment Analyst. He has been working in the wealth management industry as an equity analyst from the very beginning of his career starting at Impress Capital Limited as Investment Associate. Previously, he was Assistant Manager at the Research Team of Universal Financial Solutions Limited covering 16+ companies and IPOs from&nbsp;various&nbsp;sectors. He assisted the CIO to manage portfolios of around BDT 250 crore by recommending equities that created long-term value for the investors. He successfully valued and bid 7 large IPOs worth about BDT 8,500 crore and generated maximum returns for the funds. Mr. Tamrin has completed his BBA majoring in Finance and Accounting with Magna Cum Laude from North South University and passed CFA Level I. He was the 2nd Runner-up of IDLC Presents Blueprints 2.0, one of the largest financial modeling competitions in the country.</p>',NULL,'2022-11-30',NULL,2,14,NULL,1,0,1,1,NULL,NULL,NULL,'2022-11-30 02:50:52','2022-11-30 02:50:52',NULL),(64,'Jnandip Paul','jnandip-paul','Investment Associate','<p>Mr. Paul is an Investment Associate of team Ekush &amp; has been a core part of the team from the very start. He is an active, energetic &amp; thorough person with keen attention to detail &amp; a research-oriented mindset. He has done his BBA (majoring in Finance) from the IBA, Jahangirnagar University with excellent grades &amp; currently pursuing MBA from IBA, University of Dhaka. He is also pursuing the CFA Charter holder at the same time &amp; very passionate about the capital market as well.&nbsp;</p>',NULL,'2022-11-30',NULL,2,14,NULL,1,0,1,1,NULL,NULL,NULL,'2022-11-30 02:51:20','2023-04-27 02:04:30',NULL),(65,'Srijon Ghosh','srijon-ghosh','Business Analyst','<p>Mr. Srijon is currently working as a Business Analyst, contributing to the Operations, Marketing and Communications, and Compliance Departments. He has a keen interest in Capital Market and Financial Industry, he studied Finance from Independent University, Bangladesh. With an active, go-getter &amp; detail-oriented mentality, He has made a significant contribution to the digital transformation of Ekush &amp; has been key personnel of the Marketing &amp; Operation end. He is currently pursuing his MBA in Finance from Independent University, Bangladesh.</p>',NULL,'2022-11-30',NULL,2,14,NULL,1,0,1,1,NULL,NULL,NULL,'2022-11-30 02:51:52','2023-04-27 02:04:16',NULL),(66,'Pappu Khan','pappu-khan','Senior Business Analyst','<p>Mr. Khan is working as a Senior Business Analyst in the finance and operation team. He started his career in 2019 as a finance &amp; accounts executive at UniCap Securities Limited. His area of interest is in corporate strategy and sustainability in the long run. He completed Bachelor of Business Administration in Finance from United International University (UIU). During the undergrad program, he was awarded scholarship seven times successively for outstanding academic performance.</p>',NULL,'2022-12-01',NULL,2,14,NULL,1,0,1,1,NULL,NULL,NULL,'2022-12-01 00:15:24','2022-12-01 00:15:24',NULL);
