nt at a regular interval (monthly, quarterly, yearly etc.). A SIP is a planned approach towards investments and helps to inculcate the habit of saving and building wealth for the future. Investor can start SIP with a very small amount that is minimum BDT 1,000.',NULL,17,0,1,1,NULL,NULL,NULL,'2022-03-14 11:41:33','2022-03-14 11:41:33',NULL),(55,5,'Name of the Fund','Ekush Stable Return Fund',NULL,1,0,1,1,NULL,NULL,NULL,'2023-01-08 23:56:56','2023-01-08 23:56:56',NULL),(56,5,'Nature','Open-end Mutual Fund with unlimited size',NULL,2,0,1,1,NULL,NULL,NULL,'2023-01-09 00:00:02','2023-01-09 00:00:02',NULL),(57,5,'Life & Size of the Fund','Perpetual life and unlimited size',NULL,3,0,1,1,NULL,NULL,NULL,'2023-01-09 00:01:40','2023-01-09 00:01:40',NULL),(58,5,'Sponsor & Asset Manager','Ekush Wealth Management Limited',NULL,4,0,1,1,NULL,NULL,NULL,'2023-01-09 00:04:26','2023-01-09 00:04:26',NULL),(59,5,'Trustee','Sandhani Life Insurance Company Limited',NULL,5,0,1,1,NULL,NULL,NULL,'2023-01-09 00:08:01','2023-01-09 00:08:01',NULL),(60,5,'Custodian','BRAC Bank Limited',NULL,6,0,1,1,NULL,NULL,NULL,'2023-01-09 00:11:32','2023-01-09 00:11:32',NULL),(61,5,'Initial Size of the Fund','Tk. 25,00,00,000.00 (Taka Twenty Five crore) divided into 2,50,00,000 (Two crore Fifty Lac) Units of Tk. 10 (Taka Ten) each.',NULL,7,0,1,1,NULL,NULL,NULL,'2023-01-09 00:16:23','2023-01-09 00:16:23',NULL),(62,5,'Face value','Tk. 10 (Taka Ten) per Unit',NULL,8,0,1,1,NULL,NULL,NULL,'2023-01-09 00:20:10','2023-01-09 00:20:10',NULL),(63,5,'Objective','The objective of the \"Ekush Stable Return Fund\" is to generate returns primarily through investment in money market instruments, high-quality debt securities (securities issued by government & government entities and corporations), and opportunistic equity exposure from IPO & secondary markets and to deliver that return in a tax- efficient way to the investors.',NULL,9,0,1,1,NULL,NULL,NULL,'2023-01-09 00:42:42','2023-01-09 00:42:42',NULL),(64,5,'Minimum Application Amount','Tk. 5,000.00/- per application (500 Units) for individuals; Tk. 50,000.00/ - per application (5,000 Units) for institutions; Not applicable for SIP investors.',NULL,10,0,1,1,NULL,NULL,NULL,'2023-01-09 00:52:26','2023-01-09 00:52:26',NULL),(65,5,'Dividend Policy','The EKUSH STABLE RETURN FUND aims to achieve long-term capital appreciation and shall not provide any dividend. The unitholders can realize their returns through redemption of the units during the business hour as specified by the Asset Manaaement Company.',NULL,11,0,1,1,NULL,NULL,NULL,'2023-01-09 01:02:52','2023-01-09 01:02:52',NULL),(66,5,'Tax Benefit','a) As the Fund will not provide any dividend, the unitholders will realize their positive return only in the form of capital gain through redemption of the units. According to the Income Tax Ordinance 1984, individual investors do not need to pay any tax on capital gain and thus allowing them to realize the return of Fund without any Tax. Institutional investors have to pay tax rate of 10% on capital gain which is lower than the tax rate of 20% on dividend income and thus allowing the institutional investors to realize the return of the fund more tax efficiently than the other mandatory dividend paying funds of the Country. b) Investment in the Unit Fund would qualify for investment tax credit under according to clause 10(1) of Schedule 6, Part B read with section 44(2) of the Income Tax Ordinance 1984. c) All capital gain within the Fund are tax exempted. However, the provision of the Income Tax Ordinance is subject to amendment by the Government every year through the Finance Act. As such the Sponsor, Asset Manager or the Trustee does not give any guarantee or undertaking that the provisions will remain the same in the next financial year of Bangladesh.',NULL,12,0,1,1,NULL,NULL,NULL,'2023-01-09 01:28:42','2023-01-09 01:28:42',NULL),(67,5,'Transferability','The Units of the Fund are transferable by way of inheritance/ gift and/ or by specific operation of the law.',NULL,13,0,1,1,NULL,NULL,NULL,'2023-01-09 01:32:07','2023-01-09 01:32:07',NULL),(68,5,'Encashment','The Unit holders can surrender and encash their Units to the Asset Manager and through the authorized selling agents appointed by the Asset Manager. The Asset Manager shall be liable to re-purchase the units on behalf of Fund.',NULL,14,0,1,1,NULL,NULL,NULL,'2023-01-09 01:34:35','2023-01-09 01:34:35',NULL),(69,5,'Reports and Accounts','Every Unit holder is entitled to receive annual report along with the yearly and half-yearly statements of accounts as and when published through the website (www.ekushwml.com). Every Unit holder will also get quarterly statements of portfolio on Ekush\'s official website.',NULL,15,0,1,1,NULL,NULL,NULL,'2023-01-09 01:37:22','2023-01-09 01:37:22',NULL),(70,5,'Systematic Investment Plan (SIP) Facility','Systematic Investment Plan or SIP allows investor to invest a certain pre-determined amount at a regular interval (monthly, quarterly, yearly etc.). A \"SIP\" is a planned approach towards investments and helps to inculcate the habit of saving and building wealth for the future. Investor can start SIP with a very small amount that is minimum BOT 1,000.',NULL,16,0,1,1,NULL,NULL,NULL,'2023-01-09 01:39:46','2023-01-09 01:39:46',NULL);
