INSERT INTO `learn_faqs` VALUES (5,'What is a Mutual Fund/Unit fund? How do I get return?','মিউচুয়াল ফান্ড/ইউনিট ফান্ড কি? আমি কি আমার বিনিয়োগ এর টাকা ফেরত পাব?','<p>A mutual fund/unit fund is formed by collecting savings from many investors. The pooled money or the fund then invests in securities i.e., IPOs, stocks, bonds etc. The return generated by these securities are passed to you as dividend and capital gain.</p>\r\n<p>You will get return according to your partial ownership in the fund. The asset manager like Ekush Wealth Management Limited will invest the money on behalf of you. You can sell your investments in mutual fund partially or fully at net asset value (NAV) at any time.</p>\r\n<p><img src=\"/storage/files/source/learn/1.png\" alt=\"\" width=\"629\" height=\"247\" /></p>','<p>অনেক বিনিয়োগকারীর&nbsp; কাছ থেকে সঞ্চয় (savings) সংগ্রহ করে একটি মিউচুয়াল ফান্ড /ইউনিট ফান্ড গঠিত &nbsp;&nbsp;হয়। সংগ্রহ করা অর্থ বা তহবিল তারপর &nbsp;সিকিউরিটিজ &nbsp;অর্থাৎ- আইপিও (IPO), &nbsp;স্টক (Stock), বন্ড (Bond)-এ বিনিয়োগ করে অ্যাসেট ম্যানেজার বা সম্পদ ব্যবস্থাপক । সিকিউরিটিজ থেকে আসা -রিটার্ন (লভ্যাংশ এবং মূলধনী লাভ) আপনার কাছে ফেরত দেওয়া হয় বছর শেষে।</p>\r\n<p>সম্পদ ব্যবস্থাপক একুশ ওয়েলথ ম্যানেজমেন্ট লিমিটেড আপনার পক্ষ থেকে মিউচুয়াল ফান্ড গঠন করে বিনিয়োগ করবে।</p>\r\n<p>মিউচুয়াল ফান্ড থেকে আপনি আপনার আংশিক মালিকানা অনুযায়ী রিটার্ন পাবেন।</p>\r\n<p>মিউচুয়াল ফান্ডে আপনার বিনিয়োগ, আপনি যে কোন সময় আংশিক বা সম্পূর্ণরূপে নিট সম্পদ মুল্যে [Net Asset Value] বিক্রয় (encashment) করতে পারবেন।</p>\r\n<p><img src=\"/storage/files/source/learn/1.png\" alt=\"\" width=\"629\" height=\"247\" /></p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 05:16:49','2021-06-08 05:16:49',NULL),(6,'What are the types of Mutual Fund? What are the differences between them?/ What is the difference between closed and open end mutual funds?','মিউচুয়াল ফান্ডের ধরন কি? তাদের মধ্যে পার্থক্য কি? /  ক্লোজ এবং ওপেন এন্ড মিউচুয়াল ফান্ডের মধ্যে পার্থক্য কি?','<p>Mutual funds are of two types: open-end (it is called unit fund) and close-end. In our country, close-end funds are listed in Dhaka/Chittagong Stock Exchanges.</p>\r\n<p>Differences between closed and open-end funds are provided below:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"111\">\r\n<p>Particular</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>Open end/unit fund</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>Closed end</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>Fund Size</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>Unlimited. Asset Manager can increase the fund size depending upon demand from investors.</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>Fund size is fixed.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>Life of the fund</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>There is no maturity period of the fund.</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>Usually 10 years in Bangladesh. Generally speaking, after maturity period, the fund will be absolved or converted to open end fund.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>Buy and sell process</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>You can buy/sell unit fund any time at NAV (Net Asset Value) by providing instruction to Asset Manager.</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>You need to buy and sell funds in DSE/CSE at market price.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>Fair pricing</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>You will get actual value of your investment which is NAV. Investors interest is better protected by this pricing mechanism.</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>There is chance that market price and NAV are not same. You might not get the real value of your money i.e. NAV.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','<p>মিউচুয়াল ফান্ড দুই ধরনের: ক্লোজ এবং ওপেন এন্ড (একে ইউনিটফান্ডও বলা হয়)।</p>\r\n<p>আমাদের দেশে- &nbsp;ক্লোজ এন্ড মিউচুয়াল ফান্ড ঢাকা/চট্টগ্রাম স্টক এক্সচেঞ্জে তালিকাভুক্ত এবং বেচা-কেনা করা হয়।</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"111\">\r\n<p>বিষয়</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>ওপেন এন্ড ফান্ড / ইউনিটফান্ড</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>ক্লোজ এন্ড মিউচুয়াল ফান্ড</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>তহবিলের আকার</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>অসীম (unlimited)। অ্যাসেট ম্যানেজার বিনিয়োগকারীদের চাহিদার উপর নির্ভর করে তহবিলের আকার বৃদ্ধি করতে পারেন।</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>সীমিত। তহবিলের আকার ফান্ড গঠনের সময় নির্ধারণ করা হয়।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>তহবিলের মেয়াদকাল</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>তহবিলের কোন মেয়াদকাল (maturity period) নেই।</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>বাংলাদেশে সাধারণত ১০ বছর। সাধারণভাবে বলতে গেলে, &nbsp;মেয়াদকালের পর, তহবিল অবসায়ন করা হয় অথবা ওপেন এন্ড ফান্ডে রূপান্তরিত করা হয়।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>ক্রয় এবং বিক্রয় প্রক্রিয়া</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>আপনি অ্যাসেট ম্যানেজারকে নির্দেশনা প্রদান করে NAV (নেট অ্যাসেট ভ্যালু)-তে যে কোন সময় ইউনিট ফান্ড ক্রয়/বিক্রয় করতে পারেন।</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>আপনাকে বাজার মূল্যে (market price) ডিএসই/সিএসইতে ফান্ড কিনতে এবং বিক্রি করতে হবে।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"111\">\r\n<p>ন্যায্য মূল্য</p>\r\n</td>\r\n<td width=\"265\">\r\n<p>আপনি আপনার বিনিয়োগের প্রকৃত মূল্য পাবেন যেটি হচ্ছে NAV। বিনিয়োগকারীদের সম্পদ এই মূল্য পদ্ধতি দ্বারা বেশি সুরক্ষিত।</p>\r\n</td>\r\n<td width=\"263\">\r\n<p>বাজার মূল্য এবং ন্যাভ এক নয় সম্ভাবনা আছে। আপনি হয়তো আপনার টাকার আসল মূল্য অর্থাৎ &nbsp;&nbsp;ন্যাভ পাবেন না।</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:01:29','2021-06-08 06:01:29',NULL),(7,'Which fund is better unit fund or listed fund? /Which fund is better closed end or open end?','তালিকাভুক্ত ফান্ড নাকি অ- তালিকাভুক্ত ফান্ড ভাল? /কোন ফান্ড ভাল ক্লোজ নাকি ওপেন এন্ড?','<p>In terms of pricing mechanism, unit funds are better. However, it depends on the performance of asset manager- how much return they would be able to provide consistently in long term. In the world, by mutual fund investor understands unit funds. The total size of unit fund in 2019 was USD 87 trillion.</p>','<p>মূল্য পদ্ধতি (pricing mechanism) এর ভিত্তিতে, ইউনিট ফান্ড ভাল।</p>\r\n<p>কিন্তু এটা সম্পদ ব্যবস্থাপকের কার্যক্ষমতার উপর নির্ভর করে । তারা দীর্ঘমেয়াদী ধারাবাহিকভাবে কত রিটার্ন প্রদান করতে সক্ষম হবে সেই দক্ষতা খুবই গুরুত্বপূর্ণ।&nbsp;</p>\r\n<p>সারা দুনিয়ায়, মিউচুয়াল ফান্ডে মানে হচ্ছে ইউনিট ফান্ড ।</p>\r\n<p>২০১৯ সালে, ইউনিট ফান্ড মোট &nbsp;আকার ছিল ৮৭ ট্রিলিয়ন মার্কিন ডলার।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:02:41','2022-09-25 01:42:45',NULL),(8,'What is the legal structure of mutual fund?','মিউচুয়াল ফান্ডের আইনি কাঠামো কি?/ আইনগতভাবে কিভাবে মিউচুয়াল ফান্ড গঠন করা হয়?','<p>Mutual fund is an artificial entity similar as a company. Mutual fund is formed under Trust and Registration act and after obtaining approval from BSEC.</p>\r\n<p>Just like a person, a fund can act legally. The fund can work or claim its rights under the governing law of Bangladesh.</p>\r\n<p>Difference between a company and unit fund:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Company is formed under Company Act 1994</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Mutual fund is formed under Registration Act 1882 and Trust Act 1908.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Register of Registrar of Joint Stock Companies and Firms (RJSC) and relevant authorities regulates the company.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>BSEC is the main regulator of the fund.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Nature of Business depends on the company.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>The nature of mutual fund is to invest Other People&rsquo;s Money (OPM) as per the risk and return objectives.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Shareholders are the owner of the company represented by their ownership shares.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Investor is the owner of the fund represented by the proportionate units owned.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>A board of directors is essentially a panel of people who are elected to represent shareholders. They appoint managers and take major decisions to run company affairs.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Board of Trustee is the legal guardian of the fund who is mainly responsible to oversee all the activities on behalf of the investors. Trustee appoints asset manager of the fund.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Day to day activities ran by management</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Investment and operational activities are run by Asset Manager.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Financial results are published</p>\r\n<p>quarterly and it is yearly audited.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Financial results are published</p>\r\n<p>quarterly and it is yearly audited. In addition, weekly NAV is published in financial express.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"312\">\r\n<p>Board of directors in AGM (annual general meeting) declares dividend.</p>\r\n</td>\r\n<td width=\"312\">\r\n<p>Trustee decides dividend in the trustee meeting at the year end.</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','<p>মিউচুয়াল ফান্ড একটি কোম্পানির মতো মানুষ দ্বারা সৃষ্ট একটি কৃত্রিম সত্তা।</p>\r\n<p>ট্রাস্ট (Trust) &nbsp;এবং রেজিস্ট্রেশন অ্যাক্টের (Registration Act)-এর অধীনে এবং বিএসইসি (BSEC) থেকে অনুমোদন পাওয়ার পর মিউচুয়াল ফান্ড গঠিত হয়।</p>\r\n<p>একজন ব্যক্তির মত একটি মিউচুয়াল ফান্ড আইনগতভাবে কাজ করতে পারে । মিউচুয়াল ফান্ড বাংলাদেশের আইনের অধীনে স্বাধীনভাবে কাজ করতে পারে এবং তার দাবি-দাওয়া আদায়ের জন্য আদালতে মামলাও করতে পারে।</p>\r\n<p>একটি কোম্পানি এবং ইউনিট ফান্ডের মধ্যে পার্থক্য নিচে দেওয়া হল:</p>\r\n<table style=\"height: 687px;\" width=\"774\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>কোম্পানি আইন ১৯৯৪ এর অধীনে কোম্পানি গঠিত হয়</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>মিউচুয়াল ফান্ড -নিবন্ধন আইন &nbsp;১৮৮২ এবং ট্রাস্ট অ্যাক্ট&nbsp; ১৯০৮ এর অধীনে গঠিত হয়।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>রেজিস্ট্রার অফ জয়েন্ট স্টক কোম্পানিস অ্যান্ড ফার্মস (আরজেএসসি) এবং সংশ্লিষ্ট কর্তৃপক্ষ কোম্পানি নিয়ন্ত্রণ করে।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>বিএসইসি (BSEC) এই তহবিলের প্রধান&nbsp; নিয়ন্ত্রক।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>ব্যবসার প্রকৃতি কোম্পানির উপর নির্ভর করে।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>মিউচুয়াল ফান্ডের প্রকৃতি হচ্ছে- ঝুঁকি এবং রিটার্ন উদ্দেশ্য অনুযায়ী &nbsp;বিনিয়োগ করা।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>শেয়ারহোল্ডাররা মালিকানা শেয়ার দ্বারা কোম্পানির মালিক। যে পরিমাণ শেয়ার একজন ধারন করে সে সেই পরিমাণ মালিক।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>বিনিয়োগকারী সমানুপাতিক ইউনিট দ্বারা তহবিলের মালিক।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>পরিচালনা পর্ষদ (Board of Directors) মূলত শেয়ারহোল্ডারদের প্রতিনিধিত্ব করার জন্য নির্বাচিত ব্যক্তিদের একটি পর্ষদ ।</p>\r\n<p>তারা ম্যানেজার নিয়োগ এবং কোম্পানি বিষয়ক পরিচালনার জন্য প্রধান সিদ্ধান্ত গ্রহণ&nbsp; করেন।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>বোর্ড অফ ট্রাস্টি (Board of trustee) মিউচুয়াল ফান্ডের আইনি অভিভাবক যিনি প্রধানত বিনিয়োগকারীদের পক্ষ থেকে সকল কার্যক্রম তত্ত্বাবধান করার দায়িত্বে থাকেন। ট্রাস্টি ফান্ডের অ্যাসেট ম্যানেজার নিয়োগ করেন।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>ম্যানেজার&nbsp; দ্বারা&nbsp; পরিচালিত দৈনন্দিন কার্যক্রম পরিচালনা করা হয়।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>বিনিয়োগ এবং দৈনন্দিন কার্যক্রম অ্যাসেট ম্যানেজার দ্বারা পরিচালিত&nbsp; হয়।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>তিন মাস পর পর আর্থিক ফলাফল প্রকাশ করা হয় এবং&nbsp; এটি&nbsp; বছরে একবার নীরিক্ষা (audit) করা হয়।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>তিন মাস পর পর আর্থিক ফলাফল প্রকাশ করা হয় এবং&nbsp; এটি&nbsp; বছরে একবার নীরিক্ষা (audit) করা হয়। &nbsp;উপরন্তু, সপ্তাহের রবিবার NAV, The Daily Financial Express প্রকাশ করা হয়।</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 379px;\">\r\n<p>এজিএমে (AGM) পরিচালক বোর্ড&nbsp; (বার্ষিক সাধারণ সভা) লভ্যাংশ (dividend) ঘোষণা করা হয়।</p>\r\n</td>\r\n<td style=\"width: 379px;\">\r\n<p>বোর্ড অফ ট্রাস্টি লভ্যাংশ বছর শেষে ঘোষণা করে।</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:04:29','2021-06-08 06:04:29',NULL),(9,'What are the benefits of investing in a unit fund I will get?','একুশ পরিচালিত ইউনিট ফান্ডে বিনিয়োগ করলে কি কি সুবিধা পাব?','<p>The benefits of investing in a mutual fund/ unit fund you will get, are:</p>\r\n<ul>\r\n<li><strong>You can enjoy good rate of return:</strong>&nbsp;The portfolio manager of Ekush mainly invests your money in different asset classes i.e. fixed income securities, stocks, IPOs etc. Analysts of Ekush are experienced and they try to make proper investment that generates good return in long run. Most of the fund is invested in stock which provides better return in long run.</li>\r\n</ul>\r\n<p>In the last 20 year, stocks provided 14% CAGR (compound average growth rate) per year meaning that stock market provided compounded return of 14% p.a on average.</p>\r\n<p>This return excludes dividend return (the return is based on CASPI index from 2000 to 2019, source: CSE)</p>\r\n<p><img src=\"/storage/files/source/learn/2.png\" alt=\"\" width=\"679\" height=\"297\" /></p>\r\n<p>Figure: Annual return of stock market represented by DSE and CSE indices from 1988 to 2019.</p>\r\n<p>Source: DSE/CSE.</p>\r\n<ul>\r\n<li><strong>You can reduce your investment risk:</strong>&nbsp;Ekush will diversify your money by making investment in different asset classes (among stocks, fixed- income and money market securities) etc. If you directly invest only in stock market, it might not be appropriate for you as stocks are very risky.</li>\r\n<li><strong>You can get guaranteed IPO allocation:</strong>&nbsp;Mutual funds enjoy a 10% (ten percent) privileged quota for all Initial Public Offerings (IPOs). IPOs provides extreme return. Sometimes IPO doubled in few days after trading in the exchanges. You can enjoy the benefit of IPO through funds of Ekush which may not available otherwise.</li>\r\n<li><strong>You can reduce tax expense:&nbsp;</strong>You can reduce tax by investing in Ekush managed mutual fund. Your dividend income up to BDT 25,000 is tax-free . In addition, profits generated by the mutual fund are tax exempted.&nbsp;Capital gain for individual are also tax free.</li>\r\n</ul>\r\n<p>In addition, if you invest in Ekush managed fund, the amount will treated as investment allowance just like Sanchaypatra. This will reduce your tax expenses.</p>\r\n<p>If you reached the investment limit for Shanchaypatra, Ekush&rsquo;s Fund is the right option for you to maximize the return.</p>\r\n<ul>\r\n<li><strong>You can buy and sell your investments anytime</strong>: You can buy and sell units of Ekush managed funds at NAV at any time. It is considered one of the liquid investment.</li>\r\n</ul>\r\n<p>&nbsp;</p>','<p>একুশ পরিচালিত ইউনিট ফান্ডে বিনিয়োগ করলে নিচের সুবিধাগুলো পাওয়া যাবে:</p>\r\n<ul>\r\n<li><strong>দীঘ-মেয়াদি ভাল রিটার্ন:</strong> একুশের পোর্টফোলিও ম্যানেজার (portfolio manager) প্রধানত বিভিন্ন সম্পদ শ্রেণীতে (asset class) যেমনঃ ফিক্সড ইনকাম সিকিউরিটিজ, স্টক, আইপিও ইত্যাদিতে আপনার টাকা বিনিয়োগ করেন । একুশের রয়েছে একদল অভিজ্ঞ বিশ্লেষক (analyst) এবং তারা যথাযথ বিনিয়োগ বিশ্লেষণ করে থাকে যা দীর্ঘ মেয়াদে ভাল রিটার্ন দেয়।</li>\r\n</ul>\r\n<p>বিগত ২০ বছরে, &nbsp;স্টক প্রতি বছর ১৪% CAGR&nbsp; (জ্যামিতিক গড় বৃদ্ধির হার) প্রদান করে যার মানে স্টক মার্কেট গড়ে ১৪% হারে যৌগিক (compounding) রিটার্ন প্রদান করে।</p>\r\n<p>এই রিটার্ন লভ্যাংশ রিটার্ন বাদ দিয়ে গননা করা। &nbsp;</p>\r\n<p>(রিটার্ন ২০০০ থেকে ২০১৯ সাল পর্যন্ত CASPI সূচকের উপর ভিত্তি করে, সূত্র: সিএসই)</p>\r\n<p><img src=\"/storage/files/source/learn/2.png\" alt=\"\" width=\"679\" height=\"297\" /></p>\r\n<p>চিত্র: ১৯৮৮ থেকে ২০১৯ সাল পর্যন্ত ডিএসই ও সিএসই সূচক দ্বারা তৈরি স্টক মার্কেটের একটি বার্ষিক রিটার্ন।</p>\r\n<p>সূত্র:ডিএসই/সিএসই।</p>\r\n<ul>\r\n<li><strong>আপনি আপনার বিনিয়োগ </strong><strong>এর ঝুকি&nbsp; কমাতে পারেন:</strong> &nbsp;একুশ বিভিন্ন সম্পদ শ্রেণীতে (asset class) জথাঃ স্টক, ফিক্সড-ইনকাম এবং মানি মার্কেট সিকিউরিটিজ)&nbsp; ইত্যাদিতে বিনিয়োগ করবে ফলে, আপনার সম্পদের বহূমুখিকরন (Diversification) &nbsp;হবে। আপনি যদি সরাসরি শেয়ার বাজারে বিনিয়োগ করেন, &nbsp;তাহলে তা খুব ঝুঁকিপূর্ণ হতে পারে বলে আপনার &nbsp;জন্য তা উপযুক্ত নাও হতে &nbsp;পারে। &nbsp;</li>\r\n<li><strong>আপনি </strong><strong>গারান্টেড </strong>&nbsp;<strong>আইপিও</strong> <strong>&nbsp;বরাদ্দ পারেন:</strong> &nbsp;ইউনিট ফান্ড সকল প্রাথমিক গনপ্রস্তাবের (আইপিও) জন্য ১০% (দশ শতাংশ) &nbsp;সুবিধাজনক কোটা উপভোগ করে। আইপিও &nbsp;প্রায়ই অস্বাভাবিক রিটার্ন প্রদান করে। বাংলাদেশে এক্সচেঞ্জএ ট্রেড করার পর কয়েক দিনের মধ্যে &nbsp;আইপিও &nbsp;বহুগুণ &nbsp;হয়েছে। একুশের তহবিলের মাধ্যমে আইপিওর &nbsp;&nbsp;সুবিধাভোগ করতে পারবেন যা অন্য বিনিয়োগ মাধ্যমে পাওয়া নাও যেতে পারে।</li>\r\n<li><strong>আপনি </strong><strong>আয়কর </strong>&nbsp;<strong>খরচ</strong> <strong>কমাতে পারেন: </strong>আপনি একুশ পরিচালিত মিউচুয়াল ফান্ডে বিনিয়োগ করে কর কমাতে পারেন। &nbsp;আপনার লভ্যাংশ আয় &nbsp;২৫,০০০.০০ টাকা পর্যন্ত করমুক্ত। উপরন্তু, মিউচুয়াল ফান্ড দ্বারা অর্জিত মুনাফা করমুক্ত।&nbsp; ব্যক্তির জন্য মূলধনী লাভও করমুক্ত।</li>\r\n</ul>\r\n<p>উপরন্তু, আপনি একুশ পরিচালিত মিউচুয়াল ফান্ডে বিনিয়োগ সঞ্চায়পত্র এর মত বিনিয়োগ ভাতা /Investment Tax Credit &nbsp;হিসাবে &nbsp;বিবেচনা করা &nbsp;হয়। &nbsp;এর ফলে আপনার আয়কর অনেক কমে যাবে।</p>\r\n<p>আপনি যদি সঞ্চায়পত্র জন্য বিনিয়োগ সীমায় পৌঁছান,&nbsp; তাহলে একুশের তহবিল করার সঠিক বিকল্প এবং আপনার রিটার্ন সর্বোচ্চ হতে পারে।</p>\r\n<p><strong>আপনি যে কোন সময় একুশ পরিচালিত মিউচুয়াল ফান্ডে কিনতে এবং বিক্রি করতে পারবেন</strong>: &nbsp;আপনি যে কোন সময় NAV এ একুশ পরিচালিত তহবিল &nbsp;ক্রয় এবং বিক্রি করতে পারেন। &nbsp;এটি নগদ করা খুব সহজ।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:18:50','2021-06-08 06:18:50',NULL),(10,'How does a mutual fund generate profit?','মিউচুয়াল ফান্ড কিভাবে মুনাফা অর্জন করে?','<p>A mutual fund invests your money in different stocks/ bonds/ IPOs etc. As the market prices of these securities change over time, the mutual fund makes money. Mutual fund also earns from dividend and interest income from these securities.</p>','<p>একটি মিউচুয়াল ফান্ড বিভিন্ন স্টক/ বন্ড/ আইপিও ইত্যাদিতে আপনার টাকা &nbsp;বিনিয়োগ করে। সময়ের সাথে সাথে এই&nbsp; সিকিউরিটিজের বাজার মূল্য পরিবর্তিত হয় এবং মিউচুয়াল ফান্ড অর্থ উপার্জন করে। মিউচুয়াল ফান্ড এছাড়াও &nbsp;এই সকল সিকিউরিটিজ থেকে লভ্যাংশ এবং সুদ উপার্জন করে।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:19:53','2021-06-08 06:19:53',NULL),(11,'How my money is protected in Ekush’s mutual fund?/ Will I get my money back?','একুশের মিউচুয়াল ফান্ডে আমার  টাকা  কিভাবে সুরক্ষিত?/ আমি কি আমার টাকা ফেরত পাব?','<p>Your investment is secured. Your ownership certificates i.e. units of mutual funds are backed by investments in different financial assets i.e. stocks, bonds, IPOs etc. You are the proportionate owner of the Fund represented by the units you buy.</p>\r\n<p>There are four levels of protection of your investment in Ekush&rsquo;s fund:</p>\r\n<p><img src=\"/storage/files/source/learn/3.png\" alt=\"\" width=\"665\" height=\"354\" /></p>\r\n<p>Figure: Four level of protections of your money.</p>\r\n<p><strong>The first level of protection comes from regulator</strong> i.e. Bangladesh Securities and Exchange Commission (BSEC <a href=\"http://www.secbd.gov.bd\">www.secbd.gov.bd</a>). Nobody can pool savings without proper license from either from Bangladesh Bank or BSEC. In addition to that, Ekush First Unit Fund is also Government/ BSEC approved.</p>\r\n<p>As a capital market intermediary, Ekush is licensed under BSEC. All the investing activities are regulated and reported to BSEC on monthly and quarterly basis.</p>\r\n<p><strong>The second level of protection comes from trustee</strong> i.e. Sandhani Life Insurance Co. Limited who is the legal guardian of the fund. On behalf all the investors, their main work is to protect your interest. In every quarter, Trustee conducts meeting with Ekush to brief the all the investment positions and the financial statements are examined and reviewed by Trustee. The financial statements are published in the newspaper and website on quarterly basis. They are also licensed under BSEC and reports all activities of the fund to BSEC.</p>\r\n<p><strong>Third level of protection comes from Custodian.</strong> All the ownership certificates of investment are kept in the vault to custodian i.e. Brac Bank Limited. The detail of all investments is provided on the website (http://ekushwml.com/ekush-first-unit-fund/#portfolio-statement) of Ekush quarterly and published in the National newspapers. If you like to examine the fund&rsquo;s investment you can easily do that from your home. Mutual fund are more transparent than bank deposits. You will know better about where your money is kept. There is a saying &ldquo;Buyer&rsquo;s Beware&rdquo;. It is your responsibility to know where your money is invested.</p>\r\n<p><strong>Fourth level of protection comes from the Board of Directors of Ekush.</strong> The paralysis of body comes from Brain. Board of Directors of company is the brain. All the financial organizations that become weak because of the owner&rsquo;s personal interest in Bangladesh.</p>\r\n<p>The owners of Ekush are reputed businesspersons who have legacy of ethical business in Bangladesh more than 50 years. <strong>Mr. Md. Waliullah, FCA</strong> is the Chairman, who is the managing partner of Malek Siddique Wali, a reputed Chartered Accountant Firm. <strong>Mr. Swadesh Ranjan Saha FCA</strong> is the Vice Chairman who is the owner of Apple Bangladesh and Director of Alpha Rating and Satcom IT Limited. These people are very ethical and has long reputation of conducting business. So, your investment will be in safe hands.</p>\r\n<p>In addition, many of the directors hold CFA designation. CFA is the most prestigious and professional degree in investment. Every CFA charter holder are vowed to protect the interest and work ethically. <em>So, protection from Ekush is the main protection to you.</em></p>\r\n<p>&nbsp;</p>','<p>আপনার বিনিয়োগ সুরক্ষিত। আপনার মালিকানা সার্টিফিকেট অর্থাৎ মিউচুয়াল ফান্ডের ইউনিট দ্বারা আপনি তহবিলের সমানুপাতিক&nbsp; মালিক। তাই মিউচুয়াল ফান্ডে থেকে বিনিয়োগ করা স্টক, বন্ড, আইপিও ইত্যাদিরও আপনি সমানুপাতিক&nbsp; মালিক।</p>\r\n<p>একুশের মিউচুয়াল ফান্ডে আপনার বিনিয়োগের চারটি সুরক্ষা স্তর রয়েছে:</p>\r\n<p><img src=\"/storage/files/source/learn/3.png\" alt=\"\" width=\"665\" height=\"354\" /></p>\r\n<p>চিত্র: আপনার টাকার চার স্তরের সুরক্ষা।</p>\r\n<p><strong>সুরক্ষার প্রথম স্তর আসে নিয়ন্ত্রক</strong> <strong>সংস্থা&nbsp; অর্থাৎ Bangladesh&nbsp; Securities এবং&nbsp; Exchange&nbsp; Commission (BSEC&nbsp; </strong><a href=\"http://www.secbd.gov.bd\"><strong>www.secbd.gov.bd)</strong></a> <strong>থেকে।</strong>&nbsp; বাংলাদেশ ব্যাংক বা বিএসইসি&nbsp; &nbsp;&nbsp;থেকে যথাযথ লাইসেন্স ছাড়া কেউ টাকা স্ংগ্রহ করতে পারবে না। একুশের মিউচুয়াল ফান্ড সরকার/বিএসইসি &nbsp;অনুমোদিত।</p>\r\n<p>পুঁজিবাজারের মধ্যস্থতাকারী/ প্রতিষ্ঠান হিসেবে একুশকে&nbsp; বিএসইসির অধীনে লাইসেন্স নিতে হয়েছে। সকল বিনিয়োগ কার্যক্রম&nbsp; নিয়ন্ত্রিত হয় বিএসইসি দ্বারা। মাসিক ও ত্রৈমাসিক ভিত্তিতে বিএসইসিতে সকল বিনিয়োগ কার্যক্রম রিপোর্ট করা হয়।</p>\r\n<p><strong>সুরক্ষার দ্বিতীয় স্তর আসে ট্রাস্টি</strong> <strong>অর্থাৎ&nbsp; সন্ধ্যানী লাইফ ইন্স্যুরেন্স কোম্পানি লিমিটেড থেকে।</strong> ট্রাস্টি একুশের মিউচুয়াল ফান্ডের আইনি &nbsp;অভিভাবক। &nbsp;সকল বিনিয়োগকারীদের পক্ষ থেকে &nbsp;ট্রাস্টির প্রধান&nbsp; কাজ&nbsp; বিনিয়োগকারীদের স্বার্থ রক্ষা করা।&nbsp; প্রতিটি ক্ষেত্রে, ট্রাস্টি সকল বিনিয়োগ অবস্থান পর্যালোচনা করেন। আর্থিক বিবৃতি (financial statements) ট্রাস্টি দ্বারা পর্যালোচনা করা হয় । আর্থিক বিবৃতি ত্রৈমাসিক ভিত্তিতে সংবাদপত্র এবং ওয়েবসাইটে প্রকাশিত হয়।&nbsp; ট্রাস্টি এছাড়াও বিএসইসির অধীনে লাইসেন্স প্রাপ্ত এবং তহবিলের সকল কার্যক্রম তারা বিএসইসিকে জানায়।</p>\r\n<p><strong>সুরক্ষার তৃতীয় স্তর আসে তত্ত্বাবধায়কের </strong><strong>বা Custodian- Brac Bank Limited এর কাছ থেকে।</strong> আপনার মালিকানা সনদ (unit certificates) জমা রাখা হয় CDBL (Central Depository Bangladesh Limited)-এ থাকা আপনার BO Account-এ। এই কাজটি করা হয় অর্থাৎ ব্র্যাক ব্যাংক লিমিটেড এর সাহায্যে। এছাড়া একুশ মিউচুয়াল ফান্ডের যাবতীয় সিকিউরিটিজ&nbsp; অর্থাৎ- আইপিও (IPO),&nbsp; স্টক (Stock), বন্ড (Bond)- ইত্যাদির মালিকানা সনদ (ownership certificates) জমা থাকে ব্র্যাক ব্যাংক লিমিটেড এর কাছে। অ্যাসেট ম্যানেজারকে কোন সিকিউরিটিজ বা বিনিয়োগ বিক্রি করতে হলে ব্র্যাক ব্যাংক লিমিটেড এর কাছে এনে তা সম্পাদন করতে হয়।&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n<p>একুশ &nbsp;&nbsp;সকল &nbsp;বিনিয়োগের&nbsp; বিস্তারিত বিবরণ &nbsp;ত্রৈমাসিক ভিত্তিতে ওয়েবসাইট(http://ekushwml.com/ekush-first-unit-fund/#portfolio-statement) &nbsp;প্রদান করা &nbsp;হয় এবং জাতীয় সংবাদপত্রে প্রকাশিত করে। আপনি যদি ফান্ডের বিনিয়োগ যাচাই &nbsp;করতে চান তাহলে আপনি সহজেই আপনার বাড়ি থেকে তা করতে পারেন।</p>\r\n<p>মিউচুয়াল ফান্ড ব্যাংকে রাখা আমানতের &nbsp;চেয়ে বেশি স্বচ্ছ। আপনার টাকা কোথায় বিনিয়োগ করা আছে সে সম্পর্কে আপনি মিউচুয়াল ফান্ড &nbsp;থেকে ভালোভাবে জানতে পারবেন যেটা ব্যাংকের আমানতের ক্ষেত্রে সম্ভব না । ইংরেজিতে একটা কথা আছে \"ক্রেতা সাবধান/ Buyers Beware\" । আপনার টাকা কোথায় বিনিয়োগ করা হয় তা জানা আপনার দায়িত্ব।</p>\r\n<p><strong>সুরক্ষার চতুর্থ স্তর আসে একুশের পরিচালনা পর্ষদ থেকে। </strong>কোম্পানির পরিচালনা পর্ষদ হচ্ছে মস্তিষ্কএর মতো। যে কোন প্রতিষ্ঠান সাফল্য লাভ করে সৎ ও দক্ষ পরিচালনা পর্ষদ এর জন্য।</p>\r\n<p>একুশের মালিকরা সৎ ও দক্ষ ব্যবসায়ী যারা বাংলাদেশে ৫০ বছরের বেশি সময় ধরে নৈতিকতার সাথে ব্যবসা করে যাচ্ছেন। । <strong>জনাব মোঃ ওয়ালিউল্লাহ, এফসিএ</strong> ,চেয়ারম্যান, যিনি চার্টার্ড অ্যাকাউন্ট্যান্ট ফার্ম মালেক সিদ্দিক ওয়ালির ব্যবস্থাপনা&nbsp; অংশীদার (Managing Partner)। <strong>জনাব স্বদেশ রঞ্জন সাহা</strong><strong>, এফসিএ,</strong> অ্যাপল বাংলাদেশের (Apple Banglades) মালিক এবং আলফা রেটিং লিমিটেডে এবং সাটকম আইটি লিমিটেডের ভাইস&nbsp; চেয়ারম্যান।&nbsp; এনাদের দীর্ঘদিনের ব্যবসা পরিচালনার সুনাম আছে। তাই, আপনার বিনিয়োগ নিরাপদ হাতে থাকবে।</p>\r\n<p>উপরন্তু, একুশের অনেক পরিচালকরা সিএফএ (CFA)&nbsp; পদবী ধারণ করে। সিএফএ বিনিয়োগ বিষয়ে সবচেয়ে মর্যাদাপূর্ণ এবং পেশাদারী &nbsp;ডিগ্রী। প্রত্যেক সিএফএ&nbsp; চার্টারহোল্ডার বিনিয়োগকারিদের স্বার্থ রক্ষা এবং নৈতিকভাবে কাজ করার অঙ্গীকার করেন। <em>সুতরাং, একু</em><em>শের&nbsp; সৎ ও দক্ষ পরিচালনা পর্ষদ &nbsp;থেকে যেই সুরক্ষা সেটাই আপনার জন্য প্রধান সুরক্ষা।</em></p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:22:59','2021-06-08 06:22:59',NULL),(12,'How do I know about my investments in Ekush First Unit Fund? How transparent your investment activity is?','একুশের মিউচুয়াল ফান্ডে আমার বিনিয়োগ সম্পর্কে আমি কিভাবে জানবো? / আপনাদের বিনিয়োগ কার্যক্রম কতটা স্বচ্ছ?','<p>After your investment in Ekush First Unit Fund, we will let you know your investment results weekly in two ways. We will directly email you detailing your investment results. We will publish NAV of the fund in The Financial Express on each Sunday. For example, if your investment cost is 11.00 per Unit and in the newspaper you see NAV is 12.00, you can easily estimate your profit is 1.00 or return is 9%.</p>\r\n<p>Ekush&rsquo;s Fund has the highest level of transparency in Bangladesh that no other investment opportunity has. When you make deposit in your bank, you do not what what the bank is doing, whom they are lending. It is impossible for you to understand risks your banker is taking without being an insider.</p>\r\n<p>In contrast, when you invest in Ekush&rsquo;s fund you can easily check where your money is invested.</p>\r\n<p>We are quarterly uploading financial statements and details of investments. You need not to be a rocket analyst to understand the risk we are taking.</p>\r\n<p>This investment has the highest form of transparency in Bangladesh. You can confidently trust the transparency of your investment.</p>','<p>একুশের মিউচুয়াল ফান্ডে আপনার বিনিয়োগের পর, আমরা আপনাকে সাপ্তাহিক দুই ভাবে বিনিয়োগের ফলাফল জানাবো। প্রথমত, বিনিয়োগের ফলাফল সম্পর্কে বিস্তারিত জানিয়ে আমরা আপনাকে সরাসরি ইমেইল করব।</p>\r\n<p>দ্বিতীয়ত, প্রতি রবিবার ফিনান্সিয়াল এক্সপ্রেস পত্রিকায় তহবিলের NAV (নেট অ্যাসেট ভ্যালু) প্রকাশ করবে। উদাহরণস্বরূপ, যদি আপনি বিনিয়োগ করেন ১১.০০ টাকায় এবং&nbsp; সংবাদপত্রে আপনি NAV ১২.00 টাকা দেখতে পান, আপনি সহজেই অনুমান করতে পারবেন যে, আপনার মুনাফা ১.00 টাকা অথবা রিটার্ন&nbsp; ৯% হয়েছ।</p>\r\n<p>একুশের মিউচুয়াল ফান্ডে বিনিয়োগ যেরকম পর্যায়ের স্বচ্ছ তা বাংলাদেশের অন্য কোন বিনিয়োগে নাই।</p>\r\n<p>যখন আপনি আপনার ব্যাংকে আমানত করেন, তখন আপনার টাকা নিয়ে ব্যাংক কি করছে, তারা কাকে ঋণ দিচ্ছে তা আপনার পক্ষে যাচাই করা খুবই কষ্টকর। আপনার ব্যাংক কি পরিমাণ ঝুঁকি নিচ্ছে তা আপনার পক্ষে &nbsp;বোঝা প্রায় অসম্ভব।</p>\r\n<p>যখন আপনি একুশের মিউচুয়াল ফান্ডে বিনিয়োগ করবেন, তখন আপনি সহজেই যাচাই করতে পারবেন কোথায় আপনার&nbsp; টাকা বিনিয়োগ করা হয়েছে।</p>\r\n<p>ত্রৈমাসিক ভিত্তিতে আর্থিক বিবৃতি (financial statements) এবং &nbsp;বিনিয়োগ বিস্তারিত (Portfolio statements) ওয়েব সাইটে &nbsp;আপলোড করা হয়। &nbsp;একুশের মিউচুয়াল ফান্ডে যে পরিমাণ ঝুঁকি নিয়েছে তা আপনি ধারনা করতে পারবেন এই তথ্য গুলো দেখে।</p>\r\n<p>আপনি আত্মবিশ্বাসের সাথে এই বিনিয়োগের স্বচ্ছতার উপর নির্ভর করতে পারেন।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:24:21','2021-06-08 06:24:21',NULL),(13,'Stock market is not stable, I am going to lose money, why then I will invest?/ what is the main risk of this investment?/ Is there a chance of capital loss?','শেয়ার বাজার স্থিতিশীল নয়, আমি টাকা হারাতে পারি। তাহলে আমি কেন বিনিয়োগ করব? /  এই বিনিয়োগের প্রধান ঝুঁকি কি?/ মূলধন হারানোর সম্ভাবনা আছে কি?','<p>Your money will be invested in stock market, fixed income, and money market. The portion invested in stock market will fluctuate which is common phenomena in the world. In very short term, like less than one year, there are many factors including market phycology, manipulation, macro-economic factors etc. that affect the stock prices.</p>\r\n<p>However, in long term, stock prices tend to follow the fundamental factors of the company like profitability etc. There is a saying, in short term, stock market is a voting machine and in long term it is weighting machine.</p>\r\n<p>Bangladesh capital market is very small. Small amount of money can influence stock prices. But, if we look at mid to long term i.e. more than 5 years, we can confidently say that good companies with strong fundamentals with favorable buy price will provide best returns.</p>\r\n<p>The tricky part here is finding good companies and more challenging part is finding out reasonable prices to entry. There is a saying that astute businessmen make profits not by selling but at the time of buying.&nbsp;</p>\r\n<p><img src=\"/storage/files/source/learn/4.png\" alt=\"\" /></p>\r\n<p>The market risk of stock will tend to reduce with the time, given skill of asset manager and company invested.</p>\r\n<p>We will diversify the stock investment in different sectors and among different sector into different companies. We are confident, as indicated by our past performance, that will deliver value to generate your long -term wealth.</p>\r\n<p>Our analysts are continuously looking for low risk and high return investments. They are highly professional with the latest knowledge (many of the employees of the company are CFA charter holders) and proven track record.</p>\r\n<p>Our investment philosophy is value investing which is the proven and safest way of making investment.</p>\r\n<p>In conclusion, there is chance of capital loss in very short term. the probability of making loss in long term loss depends mainly on the skill of asset manager and your strength of remaining invested in the fund.</p>','<p>আপনার টাকা একুশের মিউচুয়াল ফান্ডে থেকে শেয়ার বাজার, ফিক্সড ইনকাম এবং মানি মার্কেটে বিনিয়োগ করা হবে। শেয়ার বাজারে বিনিয়োগ ওঠানামা করবে&nbsp; যা বিশ্বে একটি সাধারণ ব্যাপার। &nbsp;খুব স্বল্প মেয়াদে, &nbsp;যেমন &nbsp;এক বছরের কম সময়ে, মনস্তত্ত্ব, ম্যানিপুলেশন,সামষ্টিক অর্থনৈতিক উপাদান ইত্যাদিসহ অনেক উপাদান আছে &nbsp;যা শেয়ারের দামকে প্রভাবিত করে।</p>\r\n<p>দীর্ঘমেয়াদে স্টক প্রাইস কোম্পানির মৌলিক উপাদান যেমন মুনাফা ইত্যাদি অনুসরণ করে। একটি প্রবাদ আছে, &nbsp;স্বল্প মেয়াদে, &nbsp;স্টক মার্কেট একটি ভোটিং মেশিন এবং দীর্ঘমেয়াদী এটি ওজন করার মেশিন।</p>\r\n<p>বাংলাদেশের পুঁজিবাজার খুবই ছোট। সামান্য পরিমাণ টাকা স্টক দাম প্রভাবিত করতে পারে। কিন্তু, যদি আমরা মধ্য থেকে দীর্ঘমেয়াদী অর্থাৎ ৫ বছরের বেশি সময় ধরে দেখি, আমরা আত্মবিশ্বাসের সাথে বলতে পারি যে সঠিক ক্রয়মূল্য সঙ্গে &nbsp;শক্তিশালী মৌলিক কোম্পানিতে বিনিয়োগ সর্বোত্তম রিটার্ন প্রদান করবে।</p>\r\n<p>এখানে জটিল ব্যাপার হচ্ছে, ভাল কোম্পানি খুঁজে বের করা এবং আরো চ্যালেঞ্জিং অংশ যুক্তিসঙ্গত মূল্যএ ক্রয় করা। একটি প্রবাদ আছে &nbsp;যে, &nbsp;ব্যবসায়ীরা বিক্রি করে নয় বরং কেনার সময় মুনাফা করে। &nbsp;</p>\r\n<p><img src=\"/storage/files/source/learn/4.png\" alt=\"\" width=\"646\" height=\"292\" /></p>\r\n<p>স্টকে বিনিয়োগ ঝুঁকি সময় সঙ্গে হ্রাস পায়। এই ঝুকি হ্রাস করার প্রক্রিয়াটি নির্ভর করে সম্পদ ব্যবস্থাপকের বিনিয়োগ দক্ষতা এবং বিনিয়োগ কৃত কোম্পানির মৌলিক ভিত্তির উপরে।</p>\r\n<p>বিভিন্ন সম্পদ শ্রেণী (asset class) &nbsp;এবং বিভিন্ন সম্পদ শ্রেণীর মধ্যে বিভিন্ন সেক্টরের বিভিন্ন কোম্পানিতে বিনিয়োগ &nbsp;বহু- মুখিকরন (Diversification) ঝুকির কমায়।</p>\r\n<p>আমাদের অতীত পারফরমেন্স আমাদের ঝুঁকি ব্যবস্থাপনার কর্মক্ষমতা &nbsp;প্রমান করে, &nbsp;যা &nbsp;আপনার দীর্ঘমেয়াদী &nbsp;সম্পদ &nbsp;অর্জন করতে সহায়তটা করবে।</p>\r\n<p>আমাদের বিশ্লেষকরা ক্রমাগত কম ঝুঁকি এবং উচ্চ রিটার্ন বিনিয়োগ খুঁজছেন (low risk high return)।&nbsp; তারা সর্বাধুনিক জ্ঞান&nbsp; (কোম্পানির অনেক বিশ্লেষক সিএফএ চার্টার হোল্ডার) এবং অত্যন্ত পেশাদার।</p>\r\n<p>আমাদের বিনিয়োগ দর্শন &nbsp;(investment philosophy -value investing) ভাল্যু ইনভেস্টমেন্ট যা বিনিয়োগ করার প্রমাণিত এবং নিরাপদ উপায়।</p>\r\n<p>খুব স্বল্প মেয়াদে মূলধন হারানোর সম্ভাবনা আছে। দীর্ঘমেয়াদী লোকসানের সম্ভাবনা প্রধানত সম্পদ ব্যবস্থাপকের দক্ষতা এবং ফান্ডে বিনিয়োগ করে দীর্ঘমেয়াদে ধরে রাখার শক্তির উপর নির্ভর করে। &nbsp;</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:27:22','2021-06-08 06:27:22',NULL),(14,'How can I make money from investing in Mutual Fund? how my return will be generated? What is the return can I expect?','আমি কিভাবে মিউচুয়াল ফান্ডে বিনিয়োগ থেকে অর্থ উপার্জন করতে পারি? /আমার রিটার্ন কিভাবে আসবে? /আমি কি রিটার্ন আশা করতে পারি?','<p>You can make money from the fund in two ways:</p>\r\n<p>1) Dividend income: After December 31 of each year, Ekush&rsquo;s&nbsp; Fund will disburse dividend, if any, to your bank account. At least 70% of the realized profit must be distributed as dividends.</p>\r\n<p>2) Capital gain: After giving dividend, the undistributed portion of the fund will be reinvested. You can sell remaining your investment and enjoy price appreciation which is called capital gain.</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>Total return = Dividend income + Capital Gain</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;Thus, total return will be equal to dividend plus capital gain.</p>\r\n<p>&nbsp;</p>\r\n<p>Your return will come from four sources which are discussed below:</p>\r\n<ol>\r\n<li>Fixed income return: This portion of return will provide cushion to your investment. Ekush after proper research invests in high quality fixed income instruments which are properly disclosed in the financial statements.</li>\r\n<li>Equity return: The portion of the fund is invested in stock market. As discussed earlier, <a href=\"#_top\">go to stock market return</a>, per year compounded return is 14% excluding dividend yield.</li>\r\n</ol>\r\n<p>This is the return of passively management (i.e. index return), active portfolio management should provide higher return.</p>\r\n<p>Ekush believes its active management will add more value to your money.</p>\r\n<p>Expected active return generally depends on two things- a) skill of the asset manager, and b) investment strategy of asset manager.</p>\r\n<p>Ekush&rsquo;s investment philosophy is value investing with long term orientation. It is considered solid, time proven and safest investment approach in the world.</p>\r\n<p>The analyst team and CIO (Chief Investment Officer) of Ekush have decade long experience and proven track record to provide return. We are confident that we will able to maximize your wealth.</p>\r\n<ol start=\"3\">\r\n<li>IPO return: This is the quick and big portion of return. Historical returns are astonishing. Some IPOs are doubled or tripled within few days of listing.</li>\r\n<li>Tax savings: This is automatic return. Whenever, you invest in Ekush managed fund, you will get tax rebate like Sanchaypatra immediately. On an average you can save 3% - 10% tax expenses (depending up on individual tax circumstances) just investing in Ekush managed fund.</li>\r\n</ol>\r\n<p>In summary, you save tax first, then Fixed Income portion provides you cushion, then stock market along with IPO provides you growth of your money.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/files/source/learn/5.png\" alt=\"\" width=\"647\" height=\"259\" /></p>\r\n<p>If you stay long time with Ekush, your chance of achieving long term financial goals is very high.</p>\r\n<p>Some of the asset managers provided return more than 12%-15% p.a. Such historical performance may not sustain and does not provide any guidance on return expectation from any mutual funds.</p>\r\n<p>And there is no guarantee that Mutual Fund investment portfolio will always generate profit or gain- there can be losses, too.</p>\r\n<p>&nbsp;</p>','<p>আপনি দুইভাবে একুশের মিউচুয়াল ফান্ড থেকে অর্থ উপার্জন করতে পারেন:</p>\r\n<p>১) লভ্যাংশ:&nbsp; প্রতিবছরের ৩১ ডিসেম্বর, মিউচুয়াল ফান্ডে আর্থিক বছর সমাপ্ত করবে। নিরীক্ষিত প্রতিবেদন পাবার পর, ট্রাস্টি লভ্যাংশ&nbsp; ঘোষনা করবেন। এরপর আপনার ব্যাংক একাউন্টে লভ্যাংশ বিতরণ করা হবে। মিউচুয়াল ফান্ডে রুলস ২০০১ অনুযায়ী, মিউচুয়াল ফান্ডের অর্জিত মুনাফার (Realize profit) অন্তত ৭০% লভ্যাংশ হিসাবে বিতরণ করতে হবে।</p>\r\n<p>২) মূলধনী লাভ:&nbsp; লভ্যাংশ প্রদান করার পর মিউচুয়াল ফান্ডের অবিতরণ করা অংশ পুনরায় বিনিয়োগ করা হবে। আপনি আপনার বিনিয়োগ অবশিষ্ট বিক্রি করতে পারবেন NAV (নেট অ্যাসেট ভ্যালু)-তে। এই NAV এর মূল্য বৃদ্ধি পেলে একে ক্যাপিটাল গেইন বা মূলধনী লাভ বলা হয়।</p>\r\n<p>মোট রিটার্ন লভ্যাংশ এবং মূলধন লাভের যোগফলের সমান হবে।</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>মোট রিটার্ন = লভ্যাংশ আয় + ক্যাপিটাল গেইন</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;আপনার রিটার্ন আসবে চারটি উৎস থেকে যা নিচে আলোচনা হল:</p>\r\n<p>১। ফিক্সড ইনকাম রিটার্ন: রিটার্নের এই অংশ আপনার বিনিয়োগের ঢাল হিসাবে কাজ করবে।&nbsp; যথাযথ গবেষণার পর একুশ উচ্চ মানের ফিক্সড ইনকাম ইন্সট্রুমেন্টে (High quality) বিনিয়োগ করেন যা আর্থিক বিবৃতিতে (financial statements) যথাযথভাবে প্রকাশ করা হয়।</p>\r\n<p>২। ইকুইটি রিটার্ন: একুশের মিউচুয়াল ফান্ড-এর যে অংশ শেয়ার বাজারে বিনিয়োগ করা হয় এবং তা থেকে যে রিটার্ন আসবে। আগে যেমন আলোচনা করা হয়েছে,&nbsp; <a href=\"#_top\">শেয়ার বাজারে ফিরে যান,</a> প্রতি বছর জ্যামিতিক গড় বৃদ্ধির হার&nbsp; রিটার্ন (লভ্যাংশ আয় ছাড়া) ১৪%।</p>\r\n<p>নিষ্ক্রিয়ভাবে (Passive investment) পরিচালিত পোর্টফোলিও ব্যবস্থাপনা অর্থাৎ &nbsp;ইনডেক্স রিটার্ন থেকে সক্রিয় পোর্টফোলিও (active investment) ব্যবস্থাপনা উচ্চতর রিটার্ন প্রদান করা উচিত।</p>\r\n<p>একুশ বিশ্বাস করে যে একুশের সক্রিয় ব্যবস্থাপনা আপনার বিনিয়োগের উচ্চমান (value addition) নিয়ে আসবে।</p>\r\n<p>সক্রিয় পোর্টফোলিও (active investment) ব্যবস্থাপনা থেকে অর্জিত রিটার্ন সাধারণত দুটি বিষয়ের উপর নির্ভর করে- ক) সম্পদ ব্যবস্থাপকের দক্ষতা, এবং খ) সম্পদ ব্যবস্থাপকের বিনিয়োগ কৌশল।</p>\r\n<p>একুশের বিনিয়োগ দর্শন (investment philosophy) দীর্ঘমেয়াদী ওরিয়েন্টেশন সঙ্গে মূল্য বিনিয়োগ (value investing)। এটি বিশ্বের কালজয়ী, প্রমাণিত এবং নিরাপদ বিনিয়োগ পদ্ধতি।</p>\r\n<p>বিশ্লেষক দল এবং একুশের চিফ ইনভেস্টমেন্ট অফিসার&nbsp; রয়েছে এক দশকের দীর্ঘ অভিজ্ঞতা এবং প্রমাণিত ট্র্যাক রেকর্ড। আমরা আত্মবিশ্বাসী যে আমরা আপনার সম্পদ সর্বোচ্চ লক্ষ অর্জন করতে সক্ষম হব। &nbsp;</p>\r\n<p>৩। আইপিও রিটার্ন: রিটার্নের দ্রুত এবং বড় একটি অংশ আসে আইপিও থেকে।&nbsp; ঐতিহাসিকভাবে, আইপিও রিটার্ন বিস্ময়কর। তালিকাভুক্ত হওয়ার কয়েক দিনের মধ্যে কিছু কিছু আইপিও উল্লখ্যযোগ্য রিটার্ন দিয়েছে।</p>\r\n<p>৪। কর সঞ্চয়: রিটার্নের এই অংশটি আপনি একুশের মিউচুয়াল ফান্ডএ বিনিয়োগ করলে সঞ্চায়পত্রের মত কর ছাড় পাবেন। আপনি গড়ে ৩% থেকে ১০% কর কমাতে পারবেন ( এটি ব্যক্তিগত পরিস্থিতির উপর নির্ভর করে)।</p>\r\n<p>সংক্ষেপে, একুশের মিউচুয়াল ফান্ডএ বিনিয়োগ করলে, আপনি প্রথমে কর সঞ্চয় করবেন, তারপর ফিক্সড ইনকাম রিটার্নের &nbsp;অংশ আপনাকে ঢাল হিসাবে কাজ করবে, তারপর আইপিও সহ স্টক মার্কেট রিটার্নে&nbsp; আপনার সম্পদের বৃদ্ধি প্রদান করবে।</p>\r\n<p><img src=\"/storage/files/source/learn/5.png\" alt=\"\" width=\"647\" height=\"259\" /></p>\r\n<p>আপনি যদি একুশের সাথে&nbsp; দীর্ঘসময় থাকেন,&nbsp; তাহলে আপনার দীর্ঘমেয়াদী আর্থিক লক্ষ্য অর্জনের সম্ভাবনা অনেক বেশি।</p>\r\n<p>কিছু সম্পদ ব্যবস্থাপক ১২%-১৫% এর বেশি রিটার্ন প্রদান করেছে।</p>\r\n<p>ঐতিহাসিক বিনিয়োগ ফলাফল ভবিষ্যতে পুনরাবৃত্তি নাও হতে পারে এবং এটি কোন মিউচুয়াল ফান্ড থেকে প্রত্যাশিত রিটার্ন সম্পর্কে কোন নির্দেশিকা প্রদান করে না।</p>\r\n<p>কোন নিশ্চয়তা নেই যে, মিউচুয়াল ফান্ড বিনিয়োগ সবসময় মুনাফা বা লাভ করবে- লোকসানও হতে পারে।</p>\r\n<p>&nbsp;</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:30:27','2021-06-08 06:30:27',NULL),(15,'When can I buy mutual funds?/ When can I sell mutual funds? /Is there a lock in period? /Is there any maturity period?','মিউচুয়াল ফান্ড কিনে কোন নির্দিষ্ট মেয়াদ পর্যন্ত ধরে রাখতে হবে কিনা? / মিউচুয়াল ফান্ডএ বিনিয়োগ করলে কি কোন লক-ইন পিরিয়ড থাকবে?','<p>Ekush managed funds have no lock in period. You can buy and sell funds online any working day.</p>\r\n<p>For SIP, you need to hold the investment at least 3 years. However, you can en-cash your SIP investment before your maturity period in emergency situation.</p>','<p>একুশ পরিচালিত মিউচুয়াল ফান্ড বিনিয়োগ করলে কোনও লক-ইন পিরিয়ড নেই। যে কোন কর্ম-দিবসে আপনি অনলাইনে মিউচুয়াল ফান্ড কিনতে এবং বিক্রি করতে পারেন।&nbsp;</p>\r\n<p>এসআইপি-র জন্য, আপনাকে কমপক্ষে ৩ বছর বিনিয়োগ ধরে রাখতে হবে। তথাপি, জরুরী পরিস্থিতিতে আপনার আপনি মেয়াদকাল পূর্ণ হবার আগে আপনার এসআইপি বিনিয়োগ নগদ / বিক্রি করতে পারেন।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:31:18','2021-06-08 06:31:18',NULL),(16,'Can the NAV go below the face value of my investment?','NAV (নেট অ্যাসেট ভ্যালু) কি আমার ফেস ভাল্যুর/ বিনিয়োগ মূল্য থেকে নিচে কমে যেতে পারে কিনা?','<p>A fund&rsquo;s NAV goes up or down depending on change in market value of the assets held by the fund. Therefore, if the market value of the assets falls substantially, there is a chance of the NAV going below the face value of the fund. However, such events are expected to be temporary as NAV is projected to grow in the long term with expert portfolio management.</p>','<p>একটি মিউচুয়াল ফান্ডের NAV (নেট অ্যাসেট ভ্যালু), ফান্ড এর ধারনকৃত সম্পদের বাজার মূল্য পরিবর্তনের উপর নির্ভর করে উপরে বা নিচে নামে। অতএব, যদি সম্পদের বাজার মূল্য উল্লেখযোগ্যভাবে কমে যায়, তাহলে এনএভি ফান্ড ফেস ভ্যালুর/ বিনিয়োগ মূল্য নিচে যাওয়ার সম্ভাবনা আছে। যাইহোক, এই ধরনের ঘটনা সাময়িক হবে যদি পোর্টফোলিও ব্যবস্থাপনার দক্ষ ও দীর্ঘমেয়াদী হয়।</p>',NULL,1,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:32:07','2021-06-08 06:32:07',NULL),(17,'What is the minimum amount I need to invest?','বিনিয়োগের ন্যূনতম পরিমাণ কত?','<p>You can start investing in Ekush First Unit Fund with minimum of BDT 5,000 on lumpsum basis. Alternatively, you can open SIP account, which is like DPS, with minimum BDT 1,000 or multiple of BDT 1,000.</p>','<p>আপনি চাইলে এককালীন বা মাসিক ভিত্তিতে&nbsp; বা একুশ ফার্স্ট ইউনিট ফান্ডে বিনিয়োগ করতে পারবেন।</p>\r\n<p>এককালীন ভিত্তিতে ন্যূনতম ৫,০০০ টাকা দিয়ে একুশ ফার্স্ট ইউনিট ফান্ডে বিনিয়োগ শুরু করতে পারেন।</p>\r\n<p>এসআইপি একাউন্ট খুলতে ন্যূনতম ১,০০০ টাকা লাগবে যা ডিপিএস-এর মত মাসিক ভিত্তিতে আপনার ব্যাংক একাউন্ট থেকে একুশ ফার্স্ট ইউনিট ফান্ডে বিনিয়োগ করা হবে ।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:48:03','2021-06-08 06:48:03',NULL),(18,'What are the fees I shall be charged against my investment ?','বিনিয়োগের জন্য আমাকে কি কে ফি/ চার্জ দিতে হবে ?','<p>When you will make the investment, you will get unit at NAV without charging any fees.</p>\r\n<p>There is an implicit fee charged on the mutual fund as per the fee schedule of BSEC&rsquo;s Mutual Fund Rules, 2001 which is given below-</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>Fund Size in Crore</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>Management fee as a % of fund size p.a.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>&lt;5</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>2.5% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>5-25</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>2.0% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>25-50</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>1.5% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>&gt;50</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>1.0% p.a</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>The fees are deducted from the net asset value of the fund over time. You can see the prospectus section of fees and charges for more information</p>','<p>যখন আপনি বিনিয়োগ করবেন, আপনি কোন ফি/ চার্জ ছাড়াই NAV-এ ইউনিট পাবেন।</p>\r\n<p>বিএসইসির মিউচুয়াল ফান্ড রুলস, ২০০১ এর ফি/ চার্জ এর তালিকা অনুযায়ী মিউচুয়াল ফান্ড এর উপর সম্পদ ব্যবস্থাপকের ব্যবস্থাপনা ফি (management fee) চার্জ করতে পারবেন যার তালিকা নিচে দেওয়া হল-&nbsp;</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>তহবিলের আকার (কোটি টাকায়)</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>ফান্ড সাইজের উপর % হিসাবে ব্যবস্থাপনা ফি</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>&lt;৫</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>২.৫% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>৫-২৫</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>২.০% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>২৫-৫০</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>১.৫% p.a</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"44%\">\r\n<p>&gt;৫০</p>\r\n</td>\r\n<td width=\"55%\">\r\n<p>১.০% p.a</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>ফি তহবিলের নিট সম্পদ মূল্য থেকে কেটে নেওয়া হয়।</p>\r\n<p>আপনি আরো তথ্যের জন্য প্রসপেক্টাস এর ফি এবং চার্জের সেকশন দেখতে পাবেন</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:49:14','2021-06-08 06:49:14',NULL),(19,'Is there any charge while I exit from my investments? or transfer my investments?','আমি যখন আমার বিনিয়োগ থেকে বের হয়ে যাব তখন কি কোন চার্জ আছে?','<p>There are no charges when you sell your funds. Units are bought and sold at NAV per unit unless declared otherwise.</p>','<p>যখন আপনি একুশ ফার্স্ট ইউনিট ফান্ডের ইউনিট বিক্রি করবেন তখন কোন চার্জ প্রযোজ্য হবে না। ইউনিট ক্রয় এবং বিক্রয় এর উপর কোন চার্জ প্রযোজ্য হবে না সম্পদ ব্যবস্থাপক দ্বারা নতুন ঘোষণা না দেয়া পর্যন্ত।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:50:07','2021-06-08 06:50:07',NULL),(20,'Can I transfer units to another account?','আমি কি ইউনিট অন্য একাউন্টে ট্রান্সফার করতে পারি?','<p>The Units of the Fund are transferable by way of inheritance/ gift and/ or by specific operation of the law. for this reason, the transferee has to have an BO account in his/her name.</p>','<p>তহবিলের ইউনিট উত্তরাধিকার/ উপহার এবং/ অথবা আইনের নির্দিষ্ট নিয়ম অনুযায়ী স্থানান্তর করা হয়। এই কারণে, &nbsp;যার নামে ট্রান্সফার হবে তার নামে একটি বিও একাউন্ট থাকতে &nbsp;হবে।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:50:51','2021-06-08 06:50:51',NULL),(21,'Do I receive any proof of purchase after my investment?','আমার বিনিয়োগের পর ক্রয়ের প্রমাণপত্র/ মালিকানা সনদ পাব কি?','<p>Yes, investors get an&nbsp;<strong>Acknowledgement slip</strong>&nbsp;authorized by at least one of the signatories of Ekush. The purchased unit will be credited in your BO account after CDBL transfers those to your broker. Then, you can see the units in your BO statement.&nbsp;This units in BO account are your owner certificates.</p>\r\n<p>You will have a &ldquo;confirmation of unit allocation&rdquo; certificate in your user account when accessed via Ekush website. It will works as certificate and verifies of your investment with us.</p>\r\n<p>You can download and print the certificate by loging www.ekushwml.com from anywhere in Bangladesh.</p>','<p>হ্যাঁ, বিনিয়োগকারীরা একটি <strong>স্বীকৃতি স্লিপ</strong> পায় যা একুশের স্বাক্ষরকারী দ্বারা অনুমোদিত।</p>\r\n<p>সিডিবিএল (CDBL) মাধ্যমে আপনার ব্রোকারের কাছে ট্রান্সফার করার পর ক্রয়কৃত ইউনিটটি আপনার বিও একাউন্টে জমা দেওয়াহবে। তারপর,&nbsp; আপনি আপনার বিও অ্যাকাউন্টে একুশ পরিচালিত মিউচুয়াল ফান্ড এর ইউনিটগুলো দেখতে পাবেন। বিও একাউন্টের এই ইউনিটগুলি আপনার মালিক প্রত্যয়নপত্র/ মালিকানা সনদ।</p>\r\n<p>এছাড়াও, একুশ ওয়েবসাইটের মাধ্যমে ঢুকে আপনার একাউন্টে \"ইউনিট বরাদ্দ নিশ্চিতকরণ\" সার্টিফিকেট দেখতে পারবেন। এটাও&nbsp;&nbsp; সার্টিফিকেট হিসেবে কাজ করবে এবং আমাদের সাথে আপনার বিনিয়োগের সত্যতা যাচাই করা যাবে। &nbsp;</p>\r\n<p>আপনি বাংলাদেশের যেকোন স্থান থেকে www.ekushwml.com লগ-ইন করে সার্টিফিকেটটি ডাউনলোড এবং প্রিন্ট করতে পারবেন।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:51:51','2021-06-08 06:51:51',NULL),(22,'How much do you charge as an entry or exit fee?','এন্ট্রি বা এক্সিট ফি হিসেবে আপনি কত চার্জ করেন?','<p>We do not charge any fees for selling units unless and until declared otherwise at a given point of time.</p>','<p>ইউনিট ক্রয় এবং বিক্রয় এর উপর কোন চার্জ প্রযোজ্য হবে না সম্পদ ব্যবস্থাপক দ্বারা নতুন ঘোষণা না দেয়া পর্যন্ত।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:52:36','2021-06-08 06:52:36',NULL),(23,'What is a Unit of a Mutual Fund?','মিউচুয়াল ফান্ডের ইউনিট কি?','<p>Shares representing the ownership in a mutual fund are generally called a unit. Investors can purchase or sell units of an open-end fund at the fund&rsquo;s contemporary NAV per unit.</p>','<p>মিউচুয়াল ফান্ডে মালিকানার প্রতিনিধিত্বকারী শেয়ারকে সাধারণত ইউনিট বলা হয়। বিনিয়োগকারীরা প্রতি ইউনিট ফান্ডের সমসাময়িক NAV-এ ইউনিট ক্রয় বা বিক্রয় করতে পারেন।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:53:18','2021-06-08 06:53:18',NULL),(24,'How do I calculate NAV ?','NAV কিভাবে গণনা করা হয় ?','<p>NAV= Total Assets &ndash; Liabilities</p>\r\n<p>NAV per unit= Value of NAV/ No of units outstanding.</p>\r\n<p>You can check the NAV progression in the following link: http://ekushwml.com/ekush-first-unit-fund/#nav.</p>','<p>NAV= মোট&nbsp; সম্পদ &ndash; দায়</p>\r\n<p>প্রতি ইউনিট ন্যাভ= ন্যাভ/ ইউনিট সংখ্যা।</p>\r\n<p>আপনি নিচের লিংকে NAV অগ্রগতি করতে পারেন:</p>\r\n<p>http://ekushwml.com/ekush-first-unit-fund/#nav.</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:54:29','2021-06-08 06:54:29',NULL),(25,'How often do you publish NAV?','একুশ কতবার NAV প্রকাশ করেন?','<p>We publish the NAV weekly on each Thursday on the company&rsquo;s website, National Daily newspaper and Social Media.</p>\r\n<p>For our Facebook link: https://www.facebook.com/search/top/?q=ekush%20wealth%20management%20limited</p>','<p>আমরা প্রতি বৃহস্পতিবার কোম্পানির ওয়েবসাইট, ডেইলি সংবাদপত্র এবং সোশ্যাল মিডিয়ায় এনএভি প্রকাশ করি।</p>\r\n<p>আমাদের ফেসবুক লিংকের জন্য দেখুন: https://www.facebook.com/search/top/?q=ekush%20wealth%20management%20limited</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:55:17','2021-06-08 06:55:17',NULL),(26,'Who can invest in mutual fund?','মিউচুয়াল ফান্ডে কে বিনিয়োগ করতে পারে?','<p>Any one can invest in mutual fund.</p>','<p>যে কেউ মিউচুয়াল ফান্ডে বিনিয়োগ করতে পারেন।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:55:55','2021-06-08 06:55:55',NULL),(27,'How do I know whether my money has been invested or not?','আমি কিভাবে জানবো আমার টাকা বিনিয়োগ করা হয়েছে কি না?','<p>You will receive annual report along with the yearly and half yearly statements of accounts as and when published on Ekush&rsquo;s website. After loging in the portal (www.ekushwml.com) you can see the investment status of you fund.</p>','<p>একুশের ওয়েবসাইটে প্রকাশিত হিসাবে আপনি বার্ষিক এবং অর্ধবার্ষিক বিবৃতিসহ, মাসিক প্রতিবেদন&nbsp; পাবেন। পোর্টালে &nbsp;(www.ekushwml.com)&nbsp;&nbsp; লগ-ইন করে&nbsp; আপনি আপনার অ্যাকাউন্ট থেকে আপনার বিনিয়োগ অবস্থা দেখতে পাবেন।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:56:41','2021-06-08 06:56:41',NULL),(28,'What do you mean by expert fund manager?','এক্সপার্ট ফান্ড ম্যানেজার বলতে কি বোঝায়?','<p>An expert fund manager is a skilled professional capable of generating better returns with minimum risk. It depends on his or her level of experience, past track record of performance and investment strategy.</p>','<p>একজন বিশেষজ্ঞ ফান্ড ম্যানেজার একজন দক্ষ পেশাদার যা ন্যূনতম ঝুঁকি নিয় সর্বোচ্চ রিটার্ন প্রদান করতে সক্ষম। এটা তার অভিজ্ঞতার, কর্মক্ষমতা &nbsp;এবং বিনিয়োগ কৌশলের অতীত ট্র্যাক রেকর্ডের উপর নির্ভর করে।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:57:28','2021-06-08 06:57:28',NULL),(29,'Who is the regulatory body for Mutual Fund?','মিউচুয়াল ফান্ডের নিয়ন্ত্রক সংস্থা কে?','<p>Bangladesh Securities and Exchange Commission (BSEC) is the regulatory body of Mutual Funds in Bangladesh.</p>','<p>বাংলাদেশ সিকিউরিটিজ অ্যান্ড এক্সচেঞ্জ কমিশন (বিএসইসি) বাংলাদেশের মিউচুয়াল ফান্ডের নিয়ন্ত্রক সংস্থা।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:58:18','2021-06-08 06:58:18',NULL),(30,'What are the key parties related to Mutual Fund?','মিউচুয়াল ফান্ডের সাথে সম্পর্কিত প্রধান পক্ষগুলো কে কে?','<p><strong>Sponsor:</strong>&nbsp;The sponsor initiates the mutual fund by investing the seed money which is minimum 10% of the total fund size.</p>\r\n<p>Ekush Wealth Management Limited is the sponsor of Ekush First Unit Fund. Ekush invested as BDT 1 crore as sponsor of the fund. &nbsp;</p>\r\n<p><strong>Trustees:</strong>&nbsp;The board of trustees is responsible for protecting the interests of the unit holders. It is an independent body having received the trusteeship license from BSEC and is not associated with the Sponsor or the Asset Management Company. Sandhani Life Insurance Co. Limited is the trustee of the fund.</p>\r\n<p><strong>Custodian:</strong>&nbsp;The custodian is responsible for physical handling and safe keeping of the assets managed by the Asset Management Company. They received the Custodian license from the regulator and are independent of the Sponsor or the Asset Management Company. Brac Bank Limited is the custodian of the fund.</p>\r\n<p><strong>Asset Management Company (AMC):</strong>&nbsp;The Asset Management Company is responsible managing the mutual funds in accordance with Bangladesh Securities and Exchange Commission Mutual fund rules, 2001 and guidelines provided by the Trustee.</p>','<p><strong>স্পন্সর: </strong>স্পন্সর মোট তহবিলের আকারের ন্যূনতম ১০% স্পন্সরশিপ/ বিনিয়োগ করে মিউচুয়াল ফান্ড চালু করে।</p>\r\n<p>একুশ ওয়েলথ ম্যানেজমেন্ট লিমিটেড&nbsp; একুশ ফার্স্ট ইউনিট ফান্ডের স্পন্সর । একুশ&nbsp; তহবিলের স্পন্সর হিসেবে ১ কোটি টাকা বিনিয়োগ করেছে।</p>\r\n<p><strong>ট্রাস্টি:</strong> ট্রাস্টি বোর্ড ইউনিট হোল্ডারদের স্বার্থ রক্ষার জন্য কাজ করে থাকেন। এটি একটি স্বাধীন সংস্থা যারা&nbsp; বিএসইসি থেকে ট্রাস্টি লাইসেন্স পেয়েছেন । সন্ধ্যানি &nbsp;লাইফ ইন্স্যুরেন্স কোং লিমিটেড এই তহবিলের ট্রাস্টি।</p>\r\n<p><strong>তত্ত্বাবধায়ক:</strong> সম্পদ ব্যবস্থাপনা কোম্পানি দ্বারা পরিচালিত সকল সম্পত্তির মালিকানা সনদ পরিচালনা এবং নিরাপদ রাখার জন্য তত্ত্বাবধায়ক দায়ী। তারা নিয়ন্ত্রক থেকে তত্ত্বাবধায়ক লাইসেন্স পেয়েছেন। ব্র্যাক &nbsp;ব্যাংক লিমিটেড এই তহবিলের তত্ত্বাবধায়ক।</p>\r\n<p><strong>অ্যাসেট ম্যানেজমেন্ট কোম্পানি (এএমসি):</strong> অ্যাসেট ম্যানেজমেন্ট কোম্পানি বাংলাদেশ সিকিউরিটিজ অ্যান্ড এক্সচেঞ্জ কমিশন মিউচুয়াল ফান্ড রুলস, ২০০১ এবং ট্রাস্টি কর্তৃক প্রদত্ত নির্দেশিকা অনুযায়ী মিউচুয়াল ফান্ড পরিচালনার দায়িত্বে রয়েছেন।</p>',NULL,2,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 06:58:56','2021-06-08 06:59:29',NULL),(31,'What documents I need to buy unit fund?','রেজিস্ট্রেশনের জন্য কি কি কাগজপত্র প্রয়োজন?','<p>If you want to buy Ekush managed fund physically you need to bring the following documents:</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"57%\">\r\n<p><strong>Documents</strong></p>\r\n</td>\r\n<td width=\"42%\">\r\n<p><strong>Quantity</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Filled-in and signed Application form</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Copy of Applicant&rsquo;s NID</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Copy of Nominee&rsquo;s NID</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Applicant&rsquo;s passport size photograph</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Nominee&rsquo;s passport size photograph</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Copy of Applicant&rsquo;s BO Acknowledgement/ Portfolio Statement</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Copy of Applicant&rsquo;s ETIN Certificate</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>Copy of Applicant&rsquo;s blank cheque leaf copy/ Bank Statement</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Alternatively, you can buy fund online by logging in the <a href=\"http://www.ekushwml.com\">www.ekushwml.com</a> website. You need to log in first and register as a user.</p>','<p>আপনি যদি একুশের অফিস এসে তহবিল কিনতে &nbsp;চান তাহলে আপনাকে নিম্নলিখিত কাগজপত্র আনতে হবে:</p>\r\n<table width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td width=\"57%\">\r\n<p><strong>নথিপত্র</strong></p>\r\n</td>\r\n<td width=\"42%\">\r\n<p><strong>পরিমাণ</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>পূরণ করা এবং স্বাক্ষরিত &nbsp;আবেদন ফরম</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>আবেদনকারীর এনআইডির কপি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>নমিনির এনআইডি\'র কপি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>আবেদনকারীর পাসপোর্ট সাইজ ছবি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>নমিনির পাসপোর্ট সাইজ ছবি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>আবেদনকারীর বিও স্বীকৃতি/ পোর্টফোলিও স্টেটমেন্টের কপি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>আবেদনকারীর ই-টিন সার্টিফিকেটের কপি</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"57%\">\r\n<p>আবেদনকারীর চেক পাতার কপি/ ব্যাংক স্টেটমেন্ট</p>\r\n</td>\r\n<td width=\"42%\">\r\n<p>১</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>অন্যথায়, আপনি <a href=\"http://www.ekushwml.com\">www.ekushwml.com</a> ওয়েবসাইটে লগ ইন&nbsp; করে অনলাইনে তহবিল কিনতে পারেন।&nbsp;&nbsp; আপনাকে প্রথমে লগ ইন করতে হবে এবং ব্যবহারকারী হিসেবে নিবন্ধন করতে হবে।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:04:08','2021-06-08 07:04:08',NULL),(32,'Can I invest without coming to your office?','আমি কি আপনার অফিসে না এসে বিনিয়োগ  করতে পারি?','<p>Yes, the whole process can be completed online. You need to follow the following steps:</p>\r\n<p>For lump-sum investment you can directly go to &ldquo;Invest Now&rdquo; button on <a href=\"http://www.ekushwml.com\">www.ekushwml.com</a> and for SIP only you need to log in as a user first.</p>\r\n<p>You need to &nbsp;give relevant information and upload the required documents to complete purchase.</p>','<p>হ্যাঁ, পুরো প্রক্রিয়াটি অনলাইনে সম্পন্ন করা যাবে। &nbsp;আপনাকে নিম্নলিখিত পদক্ষেপগুলি অনুসরণ করতে হবে:</p>\r\n<p>বিনিয়োগের জন্য আপনি সরাসরি <a href=\"http://www.ekushwml.com\">www.ekushwml.com</a> \"বিনিয়োগ করুন\" বাটনে যেতে পারেন।</p>\r\n<p>এসআইপি-এর জন্য আপনাকে প্রথমে ব্যবহারকারী হিসেবে লগ ইন করতে হবে।</p>\r\n<p>আপনাকে প্রাসঙ্গিক তথ্য&nbsp; দিতে&nbsp; হবে এবং ক্রয় সম্পূর্ণ করতে প্রয়োজনীয় কাগজপত্র আপলোড করতে হবে।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:05:05','2021-06-08 07:05:05',NULL),(33,'Do I need a BO account and a bank account to invest in Mutual Fund?','মিউচুয়াল ফান্ডে বিনিয়োগ করার জন্য আমার কি একটি বিও একাউন্ট এবং ব্যাংক একাউন্ট প্রয়োজন?','<p>Yes. Both accounts are mandatory for investing in Mutual Fund</p>','<p>হ্যাঁ। মিউচুয়াল ফান্ডে বিনিয়োগের জন্য উভয় একাউন্ট বাধ্যতামূলক।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:05:53','2021-06-08 07:05:53',NULL),(34,'How can I open a BO Account?','আমি কিভাবে একটি বিও একাউন্ট খুলতে পারি?','<p>You can open BO account in any brokerage house nearest to you.</p>\r\n<p>Alternatively, we will help you to open BO account, if you provide us with the required documents. Brokerage houses charge a maintenance fee per year and account opening fee for BO account.</p>','<p>আপনি আপনার কাছাকাছি যেকোন ব্রোকারেজ হাউজে বিও একাউন্ট খুলতে পারেন।</p>\r\n<p>অন্যথায়, আপনি যদি আমাদের প্রয়োজনীয় কাগজপত্র সরবরাহ করেন তাহলে আমরা আপনাকে বিও একাউন্ট খুলতে সাহায্য &nbsp;করব। ব্রোকারেজ হাউস প্রতি বছর একটি রক্ষণাবেক্ষণ ফি এবং বিও একাউন্টের জন্য একাউন্ট খোলার ফি নেয়।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:06:44','2021-06-08 07:06:44',NULL),(35,'What are the required documents to open a BO account?','বিও একাউন্ট খোলার জন্য প্রয়োজনীয় কাগজপত্র কি?','<p>Listed below are the documents required by brokerage houses:</p>\r\n<ul>\r\n<li>3 copies of Passport-sized photograph</li>\r\n<li>Copy of NID/ Passport</li>\r\n<li>Copy of Bank Statement/ Cheque Leaf</li>\r\n<li>2 copies of photograph of nominee (duly attested by A/c holder)</li>\r\n<li>Copy of NID of nominee (duly attested by A/c holder)</li>\r\n</ul>','<p>ব্রোকারেজ হাউস&nbsp; কর্তৃক প্রয়োজনীয় কাগজপত্র নিচে দেওয়া হল:</p>\r\n<ul>\r\n<li>পাসপোর্ট সাইজের ছবির ৩ কপি</li>\r\n<li>এনআইডি/ পাসপোর্টের কপি</li>\r\n<li>ব্যাংক স্টেটমেন্ট/ চেক পাতার কপি</li>\r\n<li>মনোনয়নের ২ কপি (যথাযথভাবে এ/সি হোল্ডার কর্তৃক যাচাই কৃত)</li>\r\n<li>মনোনয়নের এনআইডি কপি (এ/সি হোল্ডার কর্তৃক যথাযথভাবে যাচাই কৃত)</li>\r\n</ul>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:07:23','2021-06-08 07:07:23',NULL),(36,'Is it mandatory to have an E-TIN Certificate?','ই-টিন সার্টিফিকেট থাকা কি বাধ্যতামূলক?','<p>No.You will be taxed on dividend received from the fund at 10% if you have TIN certificate. Otherwise you will be taxed at 15%.</p>','<p>না, আপনার যদি টিএন সার্টিফিকেট থাকে তাহলে আপনাকে ১০% ফান্ড থেকে প্রাপ্ত লভ্যাংশের উপর কর প্রদান করা হবে। অন্যথায়, আপনাকে ১৫% হারে কর প্রদান করা হবে।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:08:04','2021-06-08 07:08:04',NULL),(37,'How do I deposit money to purchase Ekush’ mutual fund?','আমি কিভাবে একুশ মিউচুয়াল ফান্ড কেনার জন্য টাকা জমা করব?','<p>The details of the bank account of Ekush First Unit Fund are:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>Account Name </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>Ekush First Unit Fund</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>Account Number </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>00011090000732</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>Bank </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>Midland Bank Limited</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>Branch </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>Dilkhusha Corporate Branch</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>Routing Number </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>285271933</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;You can send the money in any of the following way:</p>\r\n<ol>\r\n<li>Writing account payee cheque/ pay order/ demand draft in the name of &ldquo;Ekush First Unit Fund&rdquo; and come to our office with all the documents.</li>\r\n<li>Writing account payee cheque/ pay order/ demand draft in the name of &ldquo;Ekush First Unit Fund&rdquo; and directly deposit in the fund account mentioned above. In that case, you need to email image of cheque or instrument along with deposit slip at <a href=\"mailto:maruf@ekushwml.com\">maruf@ekushwml.com</a> or <a href=\"mailto:shuva@ekushwml.com\">shuva@ekushwml.com</a> and let us know about deposit by calling +8801713086101.</li>\r\n<li>You can directly transfer online via BEFTN but you need to call at this number +8801713086101 before transfer of the fund. You send image of EFT confirmation at <a href=\"mailto:maruf@ekushwml.com\">maruf@ekushwml.com</a> or <a href=\"mailto:shuva@ekushwml.com\">shuva@ekushwml.com</a> and let us know about deposit at +8801713086101.</li>\r\n</ol>\r\n<p>the above process is for lump-sum investment only.</p>\r\n<p>For SIP investment you need to register as user then you will have SIP-purchase option in your personal account in www.ekushwml.com.</p>','<p>একুশ ফার্স্ট ইউনিট ফান্ডের ব্যাংক একাউন্টের বিস্তারিত বিবরণ:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>অ্যাকাউন্টের নাম </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>Ekush First Unit Fund</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>একাউন্ট নম্বর </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>00011090000732</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>ব্যাংক </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>মিডল্যান্ড ব্যাংক লিমিটেড</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>শাখা </strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>দিলখুশা কর্পোরেট শাখা</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"151\">\r\n<p><strong>রাউটিং নম্বর</strong></p>\r\n</td>\r\n<td width=\"198\">\r\n<p>285271933</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>আপনি নিম্নলিখিত যে কোন উপায়ে টাকা পাঠাতে পারেন:</p>\r\n<ol>\r\n<li>\"একুশ ফার্স্ট ইউনিট ফান্ড\" নামে একাউন্ট পেই চেক (account payee cheque)/ পে অর্ডার/ ডিমান্ড ড্রাফট লেখা এবং সকল কাগজপত্র নিয়ে আমাদের অফিসে আসুন। &nbsp;</li>\r\n<li>\"একুশ ফার্স্ট ইউনিট ফান্ড\" নামে একাউন্ট পেই চেক ((account payee cheque))/ পে অর্ডার/ ডিমান্ড ড্রাফট লিখুন। উপরে উল্লিখিত ফান্ড এর ব্যাংক একাউন্টে সরাসরি জমা করুন।&nbsp; সেক্ষেত্রে, আপনাকে <a href=\"mailto:maruf@ekushwml.com\">maruf@ekushwml.com</a>&nbsp; বা&nbsp; <a href=\"mailto:shuva@ekushwml.com\">shuva@ekushwml.com</a> ডিপোজিট স্লিপসহ চেক এর&nbsp; ছবি ইমেইল করতে হবে এবং +৮৮০১৭১৩০৮৬১০১ নম্বরে ফোন করে ডিপোজিট সম্পর্কে আমাদের জানাতে হবে।&nbsp;</li>\r\n<li>আপনি সরাসরি BEFTN এর মাধ্যমে অনলাইনে ট্রান্সফার করতে পারেন। টাকা পাঠানোর আগে আপনাকে এই নম্বরে +8801713086101 নম্বরে কল করতে হবে এবং জানাতে হবে। আপনি <a href=\"mailto:maruf@ekushwml.com\">maruf@ekushwml.com</a> &nbsp;বা &nbsp;<a href=\"mailto:shuva@ekushwml.com\">shuva@ekushwml.com</a> &nbsp;EFT কনফার্মেশনের ছবি &nbsp;পাঠান এবং +৮৮০১৭১৩০৮৬১০১ নম্বরে ডিপোজিট সম্পর্কে আমাদের জানান।</li>\r\n</ol>\r\n<p>উপরোক্ত প্রক্রিয়াটি শুধুমাত্র এককালীন (lump-sum) বিনিয়োগের জন্য।</p>\r\n<p>এসআইপি (SIP) বিনিয়োগের জন্য আপনাকে ব্যবহারকারী হিসেবে নিবন্ধন করতে হবে www.ekushwml.com ওয়েবসাইটে। তারপর, আপনি আপনার ব্যক্তিগত অ্যাকাউন্ট থেকে এসআইপি ক্রয়ের অপশন পাবেন। সেই খান থেকে সহজে এসআইপিতে বিনিয়োগ করতে পারবেন।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:09:22','2021-06-08 07:09:22',NULL),(38,'What price I shall buy mutual fund? What price I shall sell my investments?','আমি  মিউচুয়াল ফান্ড কিনব কোন মূল্য ? আমি আমার বিনিয়োগ কি মূল্য এ বিক্রি করব?','<p>The buy/sell price is published online on every Thursday and reported in the daily Financial Express on every Sunday. The price mentioned on Thursday will be the effective buy price from Sunday through Wednesday in the following week. Units are not bought or sold on Thursday.</p>','<p>ক্রয়/বিক্রয় মূল্য প্রতি বৃহস্পতিবার অনলাইনে প্রকাশিত হয় এবং প্রতি রবিবার দৈনিক ফিনান্সিয়াল এক্সপ্রেসে প্রকাশ করা হয়।</p>\r\n<p>বৃহস্পতিবার উল্লিখিত মূল্য, পরের সপ্তাহে রবিবার থেকে বুধবার পর্যন্ত কার্যকর ক্রয় মূল্য হবে। বৃহস্পতিবার ইউনিট কেনা বা বিক্রি করা হয় না।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:10:46','2021-06-08 07:10:46',NULL),(39,'What is the process for selling my investments?','আমার বিনিয়োগ বিক্রির প্রক্রিয়া কি?','<p>You need to submit the&nbsp;<a href=\"https://secureservercdn.net/50.62.88.87/50g.dd0.myftpupload.com/wp-content/uploads/2018/09/EDGEBDMF-Repurchase-Surrender-Form.pdf\">Unit-Repurchase Form</a>&nbsp;and&nbsp;<a href=\"https://secureservercdn.net/50.62.88.87/50g.dd0.myftpupload.com/wp-content/uploads/2019/01/Transfer_Request_Form.pdf\">CDBL Transfer Request Form</a>&nbsp;to his/her respective brokerage house.</p>\r\n<p>The brokerage house will then contact CDBL and wait for confirmation. Upon receiving confirmation, we will disburse the payment to you through account payee cheque or BEFTN transfer, as per your request, within minimum 3 working days.</p>\r\n<p>to complete the sell process, Ekush will assist in every step.</p>','<p>আপনাকে <a href=\"https://secureservercdn.net/50.62.88.87/50g.dd0.myftpupload.com/wp-content/uploads/2018/09/EDGEBDMF-Repurchase-Surrender-Form.pdf\">ইউনিট বিক্রির ফর্ম</a> পূরণ করতে হবে। এছাড়া &nbsp;<a href=\"https://secureservercdn.net/50.62.88.87/50g.dd0.myftpupload.com/wp-content/uploads/2019/01/Transfer_Request_Form.pdf\">সিডিবিএল ট্রান্সফার রিকোয়েস্ট ফরম</a> আপনার নিজ নিজ ব্রোকারেজ হাউজে জমা দিতে&nbsp; হবে।</p>\r\n<p>এরপর ব্রোকারেজ হাউস সিডিবিএল-এর সাথে যোগাযোগ করবে এবং কনফার্মেশনের জন্য অপেক্ষা করবে। কনফার্মেশন পাওয়ার পর, আমরা আপনার অনুরোধ অনুযায়ী, ন্যূনতম ৩ কার্যদিবসের মধ্যে অ্যাকাউন্ট পেই চেক বা বিইএফটিএন ট্রান্সফারের মাধ্যমে&nbsp; আপনাকে পেমেন্ট করব।</p>\r\n<p>বিক্রয় প্রক্রিয়া সম্পন্ন করতে, একুশ প্রতিটি পদক্ষেপে সাহায্য করবে।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:14:09','2021-06-08 07:14:09',NULL),(40,'What is entry load and exit load?','এন্ট্রি লোড এবং এক্সিট লোড কি?','<p>Entry load refers to an additional fee charged on an investor&rsquo;s initial investment. Exit load is a fee charged when an investor withdraws his/her investment. there is no entry and exit load in Ekush First Unit Fund until declared otherwise. However, for SIP investment, there is 1% exit load.</p>','<p>এন্ট্রি লোড বলতে একজন বিনিয়োগকারীর প্রাথমিক বিনিয়োগের উপর অতিরিক্ত ফি ধার্য করাকে বোঝায়।</p>\r\n<p>যখন একজন বিনিয়োগকারী তার বিনিয়োগ বিক্রি করে নেয় তখন এক্সিট লোডের একটি ফি চার্জ করা হয়।</p>\r\n<p>পরবর্তী ঘোষনা না দেয়া পর্যন্ত একুশ পরিচালিত ফান্ডে কোন এন্ট্রি এবং এক্সিট লোড&nbsp; নেই।</p>\r\n<p>এসআইপি বিনিয়োগের জন্য, ১% এক্সিট লোড আছে।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:14:51','2021-06-08 07:14:51',NULL),(41,'Is there any lock-in period after investing? When can I sell my investment?','বিনিয়োগের পর কি কোন লক-ইন পিরিয়ড আছে?  আমি কখন আমার বিনিয়োগ বিক্রি করতে পারি?','<p>No. You are free to sell your units for cash anytime for lump-sum invest.</p>\r\n<p>For SIP investment, you need to hold the investment up to maturity. However, in case of emergency, you can also make pre-mature encashment by paying exit load, if any.</p>','<p>না, আপনি &nbsp;বিনিয়োগের পর যে কোন সময় নগদে আপনার ইউনিট বিক্রি&nbsp; করতে পারবেন।</p>\r\n<p>এসআইপি বিনিয়োগের জন্য, আপনাকে মেয়াদকাল পর্যন্ত বিনিয়োগ ধরে রাখতে হবে।</p>\r\n<p>জরুরী অবস্থার ক্ষেত্রে, আপনি এক্সিট লোড পরিশোধ করে মেয়াদকাল পূর্ণ হবার আগে এনক্যাশমেন্ট/ বিক্রি করতে পারেন।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:15:30','2021-06-08 07:15:30',NULL),(42,'How long do I need to wait to receive my money against sale proceed?','বিক্রয়ের পর আমার টাকা পাওয়ার জন্য আমাকে কতদিন অপেক্ষা করতে হবে?','<p>Three to Seven working days.</p>','<p>তিন থেকে সাত কার্যদিবস।</p>',NULL,3,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:16:16','2021-06-08 07:16:16',NULL),(43,'What is dividend?','লভ্যাংশ কি?','<p>Dividend is cash you will receive from the fund. It is calculated on the net profit of the fund in each year. As per mutual fund rules 2001, a fund is bound to declare 70% of the realized profit. In a particular year, there may be loss which may cause no dividend.</p>','<p>লভ্যাংশ হল নগদ টাকা যা আপনি তহবিল থেকে পাবেন। এটা প্রতি বছর তহবিলের নিট মুনাফা &nbsp;উপর এটি গণনা করা হয়।&nbsp; মিউচুয়াল ফান্ড রুলস ২০০১ অনুযায়ী, একটি তহবিল বাস্তবায়িত (realized) মুনাফার ৭০% লভ্যাংশ ঘোষণা করতে বাধ্য।&nbsp; আমি একটি নির্দিষ্ট বছর, লোকসান হতে পারে যার ফলে লভ্যাংশ নাও&nbsp; হতে পারে।&nbsp;</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:18:10','2021-06-08 07:18:10',NULL),(44,'What is CIP? what are the benefits of doing CIP?','সিআইপি কি (CIP)? সিআইপি  করার  সুবিধাগুলো কি কি?','<p>It is automatic reinvestment option by which Ekush will reinvest your dividend as per your request.</p>\r\n<p>The dividend proceeds (less tax) will be used to purchase additional fund units, thereby increasing the total number units owned by the investor.</p>\r\n<p>You can enjoy the benefit of power of compounding. which is called eight wonder of the world by Scientist Albert Einstin.</p>','<p>এটি স্বয়ংক্রিয় পুনঃবিনিয়োগ পদ্ধতি যার মাধ্যমে একুশ&nbsp; আপনার অনুরোধ অনুযায়ী আপনার লভ্যাংশ পুনরায় বিনিয়োগ করবে।</p>\r\n<p>লভ্যাংশ আয় (কর বাদ দেবার পর) অতিরিক্ত ফান্ড ইউনিট ক্রয়ের জন্য ব্যবহার করা হবে, যার ফলে বিনিয়োগকারীর মালিকানাধীন মোট ইউনিট সংখ্যা বেড়ে যাবে।</p>\r\n<p>আপনি যৌগিক (compounding) রিটার্ন এর সুবিধা উপভোগ করতে পারেন। যাকে বিজ্ঞানী&nbsp; আলবার্ট আইনস্টাইন পৃথিবীর অষ্টম আশ্চর্য বলে অভিহিত করেন।&nbsp;</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:18:48','2021-06-08 07:18:48',NULL),(45,'What is a closed period?','ক্লোজ পিরিয়ড কি?','<p>No buying or selling takes place in closed period is used for the preparation and audit of the fund&rsquo;s financial statements.</p>','<p><strong>ক্লোজ পিরিয়ড </strong>কোন ক্রয় বা বিক্রয় হয় না। তহবিলের আর্থিক বিবৃতি প্রস্তুত এবং অডিটের জন্য এই সময় ব্যবহার করা হয়।</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:19:23','2021-06-08 07:19:23',NULL),(46,'How long do I need to wait to receive dividend against my investment?','আমার বিনিয়োগের লভ্যাংশ পাওয়ার জন্য আমাকে কতদিন অপেক্ষা করতে হবে?','<p>Dividend are disbursed within 45 days of dividend declaration.</p>','<p>লভ্যাংশ ঘোষণার ৪৫ দিনের মধ্যে লভ্যাংশ বিতরণ করা হয়।</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:20:01','2021-06-08 07:20:01',NULL),(47,'How will I receive the dividend?','আমি কিভাবে লভ্যাংশ পাব?','<p>We mainly send dividends via EFT at your bank account you provided us at the time of purchase. However, depending upon your request we can also send the dividend warrants.</p>','<p>আমরা EFT এর মাধ্যমে আপনার ব্যাংক একাউন্টে লভ্যাংশ পাঠাব। আপনার অনুরোধের উপর নির্ভর করে আমরা লভ্যাংশ ওয়ারেন্টও পাঠাতে পারি।</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:20:36','2021-06-08 07:20:36',NULL),(48,'When will I receive the dividends?','আমি কখন লভ্যাংশ পাব?','<p>After each year end i.e. December 31, the audit of the fund will be started and completed</p>\r\n<p>Board of trustee will decide the dividend, if any. We will send the dividend within 45 days of dividend declaration.</p>','<p>প্রতি বছর অর্থাৎ ৩১ ডিসেম্বর শেষ হওয়ার পর তহবিলের অডিট শুরু এবং সম্পন্ন করা হবে।</p>\r\n<p>বোর্ড অফ ট্রাস্টি লভ্যাংশ নির্ধারণ করবে। লভ্যাংশ ঘোষণার ৪৫ দিনের মধ্যে লভ্যাংশের টাকা পাঠানো হবে।</p>',NULL,4,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:21:11','2021-06-08 07:21:11',NULL),(49,'What is a SIP?','এসআইপি (SIP) কি?','<p>You can start investing with Ekush with very small amount. Systematic Investment Plan (SIP) allows you to invest at least Tk.1,000.00 &nbsp;(multiple of Tk. 1000.00) on monthly basis. It will help you to build savings habit. It will bring the necessary discipline in life.</p>','<p><strong>এসআইপি</strong><strong> (SIP)</strong> হচ্ছে Systematic Investment Plan বা পদ্ধতিগত বিনিয়োগ পরিকল্পনা।</p>\r\n<p>আপনি খুব অল্প পরিমাণ টাকা দিয়ে একুশ এর সঙ্গে বিনিয়োগ শুরু করতে পারেন।</p>\r\n<p>মাসিক ভিত্তিতে ন্যূনতম ১,০০০.০০ টাকা দিয়ে এটা আপনাকে সঞ্চয়ের অভ্যাস গড়ে তুলতে সাহায্য করবে । এটা আপনার জীবনের প্রয়োজনীয় আর্থিক শৃঙ্খলা নিয়ে আসবে ।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:22:29','2021-06-08 07:22:29',NULL),(50,'What are the other benefits of SIP?',NULL,'<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Cost-Averaging will minimize the market timing risk: </strong>For example, you invest 5,000 taka monthly. Say, the first buy price of the fund is 10 taka per unit. hence, you will get 500 units of fund.</li>\r\n</ol>\r\n<p>Here is a hypothetical table provided below showing, how cost gets averaged over time with changes in per-unit price:</p>\r\n<p>After one year, you will give Tk. 60,000 with average at 10.78 and total unit will be 5,582.</p>\r\n<p>Your investment shall grow to BDT (5,582 X 11.8) = 65,869 which is equal to 10% return.</p>\r\n<p>&nbsp;</p>\r\n<p>Due to cost averaging, the difference between minimum &amp; maximum return is also narrowed down with increase in investment horizon.</p>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li><strong>No worries about market timing:</strong> Share market is full of ups &amp; downs. You want to be in the &ldquo;up&rdquo; not the &ldquo;down&rdquo;. That&rsquo;s why people often ask &ldquo;when&rsquo;s the right time to get in the capital market??&rdquo;</li>\r\n</ol>\r\n<p>But through SIP you do not need to time the market.</p>\r\n<p>Because, <strong>a) </strong>through SIP an investor is not investing directly in the stock market rather in a mutual fund which is a diversified fund. &nbsp;Mutual funds invest into fixed income securities &amp; stock markets. And <strong>b)</strong> through cost averaging, you are getting more units when the unit price is low &amp; you are getting more return when the unit price is high.</p>\r\n<p><img src=\"/storage/files/source/learn/6.png\" alt=\"\" width=\"644\" height=\"335\" /></p>\r\n<p>So, SIP is just absorbing the ups &amp; downs of the market for you.</p>\r\n<ol>\r\n<li><strong>Tax expense reduction:</strong> Bangladesh Income tax law considers the investment in a year in SIP as tax eligible investment for tax rebate like Sanchaypatra. You can reduce your tax expenses by investing in SIP.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"2\">\r\n<li><strong>Investing in a disciplined manner:</strong> You get the same d</li>\r\n<li><strong>Develops the habit of saving &amp; investing:</strong> Through SIP, this small amount is automatically debited from your bank account every month. This small investment is not going to bring any change to your current lifestyle but provides you a substantial saving in the future. it is easy.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol start=\"4\">\r\n<li><strong>Reduction of risk</strong>: The longer the investment horizon, the lesser the instances of negative return. Here is a graph of Crisil- AMFI equity fund ( an Indian Mutual fund) over the last 15 years showing how the instances of negative return moves towards 0% after 4 years. Because, during the span of years, SIP absorbs the associated risks &amp; up-downs of the market.</li>\r\n</ol>','<p>&nbsp;</p>\r\n<p><strong>১। খরচ গড়করন (Cost Averaging) বাজার ঝুঁকি কমিয়ে দেবে:</strong> <strong>&nbsp;</strong></p>\r\n<p><strong>উদাহরণস্বরূপ,</strong> আপনি মাসিক ৫,০০০&nbsp; টাকা দিয়ে SIP-তে বিনিয়োগ করলেন। ধরুন, ফান্ডের প্রথম ক্রয় মূল্য ইউনিট প্রতি ১০ টাকা। তাহলে, আপনি ৫০০ ইউনিট ফান্ড পাবেন।</p>\r\n<p>এখানে একটি টেবিল দেওয়া হল যেখানে দেখানো হয়েছে,&nbsp; কিভাবে ইউনিট মূল্য পরিবর্তনের সাথে সাথে খরচ গড়করন হয়:</p>\r\n<p>এক বছর পর আপনি মোট ৬০,০০০ টাকা দিবেন যার গড় খরচ হবে ১০.৭৮ এবং &nbsp;মোট ইউনিট হবে &nbsp;৫,৫৮২ টি।</p>\r\n<p>কিন্তু, আপনার বিনিয়োগ বেড়ে যাবে টাকা (৫,৫৮২ X ১১.৮) = ৬৫,৮৬৯ যা ১০% রিটার্নের সমান।</p>\r\n<p>খরচ গড় কারণে, ন্যূনতম এবং সর্বোচ্চ রিটার্ন মধ্যে পার্থক্য বিনিয়োগ সময় বৃদ্ধির সাথে সাথে সংকুচিত হবে।</p>\r\n<p><strong>২। বাজারকে (market timing) নিয়ে উদ্বেগ কম:</strong> শেয়ার&nbsp; বাজার দর পতন ও উথান স্বাভাবিক ব্যাপার। আপনি \" উথান\" এর মধ্যে থাকতে চান \" পতন\" এ নয়। এজন্যই মানুষ প্রায়ই জিজ্ঞেস করে \"পুঁজিবাজারে ঢোকার সঠিক সময় কখন?&nbsp;</p>\r\n<p>কিন্তু এসআইপি-র মাধ্যমে আপনাকে বাজারের সঠিক সময় নিয়ে টেনশন করতে হবে না।</p>\r\n<p>কারণ,&nbsp; এসআইপি-এর মাধ্যমে একজন বিনিয়োগকারী সরাসরি শেয়ার বাজারে বিনিয়োগ করছেন না, বরং একটি মিউচুয়াল ফান্ডে করছেন &nbsp;যা &nbsp;একটি&nbsp; বৈচিত্র্যময় &nbsp;তহবিল ( Diversified portfolio)। <strong>&nbsp;</strong>&nbsp;মিউচুয়াল ফান্ড ফিক্সড ইনকাম সিকিউরিটিজ ও স্টক মার্কেটে বিনিয়োগ করে। খরচ গড়করন মাধ্যমে, আপনি বেশি ইউনিট পাচ্ছেন যখন ইউনিট মূল্য কম। &nbsp;তাই, এসআইপি আপনার জন্য বাজারের আপ এবং ডাউন নিরপেক্ষ বা নিয়ন্ত্রন করছে।</p>\r\n<p><strong>৩। আয়-কর কমানো:</strong> বাংলাদেশ আয়কর আইন এসআইপিতে এক বছরে বিনিয়োগকে সঞ্চায়পত্রের মত কর ছাড়ের (investment tax credit) জন্য করযোগ্য বিনিয়োগ হিসেবে বিবেচনা করে। এসআইপি বিনিয়োগ করে আপনার আয়কর&nbsp; কমাতে পারেন।</p>\r\n<p><strong>৪। শৃঙ্খলাবদ্ধ পদ্ধতিতে বিনিয়োগ:</strong> আপনি একই d পান<strong>সঞ্চয় এবং বিনিয়োগের অভ্যাস গড়ে তোলে:</strong> এসআইপি-এর মাধ্যমে এই সামান্য পরিমাণ প্রতি মাসে আপনার ব্যাংক একাউন্ট থেকে স্বয়ংক্রিয়ভাবে ডেবিট করা হয়। এই ক্ষুদ্র বিনিয়োগ আপনার বর্তমান জীবনধারায় কোন পরিবর্তন আনবে না কিন্তু ভবিষ্যতে আপনাকে একটি উল্লেখযোগ্য সঞ্চয় প্রদান করবে।&nbsp; এটা সহজ।</p>\r\n<p><strong>৫। ঝুঁকি হ্রাস</strong>: বিনিয়োগ দিগন্ত যত দীর্ঘ হবে, নেতিবাচক রিটার্নের উদাহরণ তত কম হবে। এখানে গত ১৫ বছরে ক্রিসিল- এএমএফআই ইকুইটি ফান্ডের (একটি ইন্ডিয়ান মিউচুয়াল ফান্ড) একটি গ্রাফ দেখানো হয়েছে কিভাবে নেতিবাচক রিটার্নের উদাহরণ ৪ বছর পর ০% এর দিকে এগিয়ে যায়।&nbsp; কারণ, বছরের পর বছর ধরে, এসআইপি বাজারের সংশ্লিষ্ট ঝুঁকি এবং আপ-ডাউন শোষণ করে।</p>\r\n<p><img src=\"/storage/files/source/learn/6.png\" alt=\"\" width=\"644\" height=\"335\" /></p>\r\n<p>যখনই আমরা মিউচুয়াল ফান্ডের কথা চিন্তা করি, আমরা মনে করি এটা সরাসরি শেয়ার বাজারে বিনিয়োগের মত। কিন্তু তা নয়। মিউচুয়াল ফান্ড একজন অভিজ্ঞ ফান্ড ম্যানেজারের হাতে অনেক নিরাপদ এবং উচ্চতর মুনাফা উৎপাদনকারী (সঞ্চারীপাত্রের চেয়ে অনেক বেশি)।</p>\r\n<p>এসআইপি করে, আপনাকে রিটার্ন তাড়া করতে হবে না। আপনি শুধু আপনার বিনিয়োগ চালিয়ে যান; রিটার্ন তোমাকে তাড়া করবে।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:26:02','2021-06-08 07:26:02',NULL),(51,'How to invest in SIP?','কিভাবে এসআইপিতে বিনিয়োগ করতে হয়?','<p>You can open SIP account in either of the two ways</p>\r\n<ul>\r\n<li>Registering as user and then purchase SIP in online (<a href=\"http://WWW.ekushwml.com\">ekushwml.com</a>)</li>\r\n<li>You can come to Ekush&rsquo;s office and fill up the application form.</li>\r\n</ul>','<p>আপনি দুটি উপায়ে এসআইপি একাউন্ট খুলতে পারেন</p>\r\n<ul>\r\n<li>ব্যবহারকারী হিসেবে নিবন্ধন এবং তারপর অনলাইনে এসআইপি ক্রয় <a href=\"http://(WWW.ekushwml.com)\">(WWW.ekushwml.com)</a></li>\r\n<li>আপনি একুশের অফিসে এসে আবেদনপত্র পূরণ করতে পারেন।</li>\r\n</ul>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:26:46','2021-06-08 07:26:46',NULL),(52,'What is the minimum investment amount for SIP?','SIP এর জন্য ন্যূনতম বিনিয়োগের পরিমাণ কত?','<p>BDT 5,000.00. You can open SIP account for multiple of BDT 5,000.00</p>','<p>মাসিক ন্যূনতম ৫,০০০.০০ টাকা। আপনি ৫,০০০.০০ টাকার অধিক পরিমাণ টাকার এসআইপি একাউন্ট খুলতে পারবেন।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:27:23','2023-07-03 23:49:10',NULL),(53,'What are the payment options for SIP?','SIP এর জন্য পেমেন্ট অপশন কি?','<p>We only take SIP money via auto-debit facility against your bank account. Your money will be transferred to the fund account via BEFTN transfer.</p>','<p>শুধু আপনার ব্যাংক একাউন্টের সাথে সংশ্লিষ্ট অটো-ডেবিট সুবিধার মাধ্যমে এসআইপি টাকা নেয়া হয়। আপনার টাকা &nbsp;BEFTN ট্রান্সফারের &nbsp;মাধ্যমে একুশ পরিচালিত মিউচুয়াল ফান্ড এর ব্যাংক অ্যাকাউন্টে স্থানান্তর করা হবে।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:28:05','2021-06-08 07:28:05',NULL),(54,'What happens to my money after SIP maturity?','এসআইপি মেয়াদ-পূর্ণ হবার পর আমার টাকার কি হবে?','<p>After maturity of SIP, you can do any of the following options:</p>\r\n<ul>\r\n<li><strong>Auto- Renewal:&nbsp;</strong>You can easily renew the SIP and it will be continued until further notice.</li>\r\n<li><strong>Sell your investment:</strong>&nbsp;The matured amount will be kept as it is in your BO account. You can sell entire/partial amount.</li>\r\n<li><strong>Remain invested:&nbsp;</strong>The matured investment will be treated as lumpsum investment till we get sell order from you.</li>\r\n</ul>','<p>SIP এর মেয়াদ-পূর্ণ হবার পর, আপনি নিম্নলিখিত যেকোন অপশন পছন্দ করতে পারেন:</p>\r\n<ul>\r\n<li><strong>স্বয়ংক্রিয়- নবায়ন</strong><strong> (automatic renew ): </strong>আপনি সহজেই এসআইপি নবায়ন করতে পারেন এবং পরবর্তী নোটিশ না দেওয়া পর্যন্ত এটি অব্যাহত থাকবে।</li>\r\n<li><strong>আপনার বিনিয়োগ বিক্রি কর</strong><strong>তে পারবেন :</strong> &nbsp;মেয়াদ-পূর্ণ হবার পর যে টাকা হবে তা আপনার অ্যাকাউন্টে হিসাব করে রাখা হবে।&nbsp; &nbsp;আপনি সম্পূর্ণ/আংশিক &nbsp;পরিমাণ বিনিয়োগ বিক্রি করতে পারেন।</li>\r\n<li><strong>বিনিয়োগ করুন: </strong>যতক্ষণ না আমরা আপনার কাছ থেকে বিক্রয় আদেশ পাই, ততক্ষণ পর্যন্ত আপনার টাকা এককালিন বিনিয়োগ&nbsp; হিসাবে বিবেচনা করা হবে ।</li>\r\n</ul>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:28:44','2021-06-08 07:28:44',NULL),(55,'Does the SIP allow partial surrender?','এসআইপিতে কি মেয়াদ পূর্ণের পর আংশিক বিক্রি করার অনুমতি দেয়?','<p>Yes.</p>','<p>হ্যাঁ।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:29:18','2021-06-08 07:29:18',NULL),(56,'Does SIP allow investments from Joint investors?','এসআইপি কি যৌথ বিনিয়োগকারীদের কাছ থেকে বিনিয়োগের অনুমতি দেয়?','<p>Yes.</p>','<p>হ্যাঁ।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:29:53','2021-06-08 07:29:53',NULL),(57,'Does SIP allow investments from institutional investors?','এসআইপি কি প্রাতিষ্ঠানিক বিনিয়োগকারীদের কাছ থেকে বিনিয়োগের অনুমতি দেয়?','<p>Yes.</p>','<p>হ্যাঁ।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:30:31','2021-06-08 07:30:31',NULL),(58,'How to discontinue the SIP?','কিভাবে SIP বন্ধ করতে হয়?','<p>Investors need to provide an application to Ekush regarding discontinuation of SIP at least 5 working days before the next installment date.</p>','<p>পরবর্তী কিস্তির তারিখের অন্তত ৫ কার্যদিবস আগে এসআইপি বন্ধ করার ব্যাপারে বিনিয়োগকারীদের একুশকে একটি আবেদন পত্র দিতে হবে।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:31:16','2021-06-08 07:31:16',NULL),(59,'Will there be any fees or penalties for discontinuing the SIP before maturity?','মেয়াদ পূর্ণের আগে এসআইপি বন্ধ করার জন্য কি কোন ফি বা জরিমানা হবে?','<p>As of now &ndash; no additional fees are charged for discontinuing SIP before maturity. However, Ekush may charge exit load in future which will be notified at least 3 months from such decision.</p>','<p>এখন পর্যন্ত - মেয়াদ পূর্ণের আগে এসআইপি বন্ধ করার জন্য কোন অতিরিক্ত ফি ১% নেওয়া হয় । একুশ ভবিষ্যতে এক্সিট লোড চার্জ নিয়ে যে কোন ধরনের সিদ্ধান্ত থেকে অন্তত ৩ মাস আগে অবহিত করা হবে।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:32:00','2021-06-08 07:32:00',NULL),(60,'What if investor defaults on their auto debit payment?','যদি বিনিয়োগকারী তাদের অটো ডেবিট পেমেন্ট ব্যর্থ হয় তাহলে কি হবে?','<p>There are no penalties for such defaults. The default of 3 (two) consecutive installments will result in discontinuation of SIP. If you like to continue the SIP again, you need to re-enroll into a SIP. Please call +8801713986101.</p>','<p>এই ধরনের পেমেন্ট ব্যর্থ হবার জন্য কোন জরিমানা নেই। পরপর ৩ (তিন) কিস্তির পেমেন্ট ব্যর্থ হলে এসআইপি বন্ধ হয়ে যাবে। আপনি যদি আবার এসআইপি চালিয়ে যেতে&nbsp; চান, তাহলে আপনাকে পুনরায় এসআইপিতে চালু করতে হবে। এই জন্য অনুগ্রহ করে +8801713986101 নম্বরে কল করুন।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:32:58','2021-06-08 07:32:58',NULL),(61,'Can I top-up my SIP amount?/Can I increase my month installment in  SIP?','আমি কি আমার মাসিক এসআইপির পরিমাণ বাড়াতে পারি?/আমি কি এসআইপিতে আমার মাসের কিস্তি বাড়াতে পারি?','<p>You can topup installment amount once a year. However, if you want to invest lump-sum amount while continuing SIP, you can do that by coming to Ekush office or via online.</p>','<p>আপনি বছরে একবার কিস্তির পরিমাণ টপআপ (top-up) করতে&nbsp; পারেন। যাইহোক, আপনি যদি এসআইপি অব্যাহত থাকার সময় মোটা অঙ্কের পরিমাণ বিনিয়োগ করতে চান, তাহলে আপনি&nbsp; একুশ&nbsp; অফিসে অথবা অনলাইনের মাধ্যমে তা করতে পারেন।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:33:39','2021-06-08 07:33:39',NULL),(62,'Can I change my bank account information before the maturity of the SIP?','এসআইপি মেয়াদ পূর্ণের আগে আমি কি আমার ব্যাংক একাউন্টের তথ্য পরিবর্তন করতে পারি?','<p>Yes. You can change the bank details at least 5 working days before the maturity date. for the this reason please call +8801713086101.</p>','<p>হ্যাঁ। আপনি মেয়াদ পূর্ণের আগে ব্যাংক একাউন্টের তথ্য পরিবর্তন করতে পারবেন।</p>\r\n<p>এজন্য SIP এর মাসিক কিস্তির অন্তত ৫ কার্যদিবস আগে ব্যাংকের বিবরণ পরিবর্তন করার আবেদন করতে হবে। &nbsp;&nbsp;এ&nbsp; ব্যাপারে অনুগ্রহ করে +8801713086101 নম্বরে কল করুন।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:34:26','2021-06-08 07:34:26',NULL),(63,'Can the investor pay a lump sum amount in advance for SIP?','বিনিয়োগকারী কি এসআইপির কিস্তির জন্য অগ্রিম টাকা দিতে পারবে?','<p>No. We do not accept any lump sum amount in advance for SIP installment. Investors are allowed only to make installment payments every month which will be carried under EFT payment system. However, if you want to invest lump-sum amount while continuing SIP, you can do that by coming to Ekush office or via online.</p>\r\n<p><strong>&nbsp;</strong></p>','<p>না। আমরা এসআইপি কিস্তির জন্য অগ্রিম কোন পরিমাণ টাকা আমরা গ্রহণ &nbsp;&nbsp;করি না।&nbsp; বিনিয়োগকারীদের শুধু প্রতি মাসে কিস্তি পরিশোধ করার অনুমতি দেওয়া হয় যা ইএফটি পেমেন্ট সিস্টেমের অধীনে সম্পাদন করা হয়।</p>\r\n<p>আপনি যদি এসআইপি অব্যাহত থাকার সময়, মোটা অঙ্কের পরিমাণ বিনিয়োগ বা এককালিন বিনিয়োগ করতে চান, তাহলে আপনি &nbsp;একুশ &nbsp;অফিসে অথবা অনলাইনের মাধ্যমে তা করতে পারেন।</p>',NULL,5,NULL,NULL,1,0,1,1,NULL,NULL,NULL,'2021-06-08 07:34:57','2021-06-08 07:34:57',NULL);
